(61, 'Tecno Camon 17P (CG7)', 'admin', 9, 41, 15, '856', '856', 'youtube', NULL, 'techno,camon 17,smart phone', '<p>Tecno Camon 17P smartphone was launched on 7th May 2021. The phone comes with a 6.80-inch display with a resolution of 1080x2460 pixels at a pixel density of 395 pixels per inch (ppi).Tecno Camon 17P comes with 6GB of RAM. The Tecno Camon 17P runs Android 11 and is powered by a 5000mAh battery. The Tecno Camon 17P supports proprietary fast charging.\r\n</p><p>As far as the cameras are concerned, the Tecno Camon 17P on the rear packs a 64-megapixel primary camera; a 2-megapixel camera; a 2-megapixel camera, and an AI camera. It sports a 16-megapixel camera on the front for selfies.\r\n</p><p>The Tecno Camon 17P runs HiOS 7.6 is based on Android 11 and packs 128GB of inbuilt storage. The Tecno Camon 17P measures 168.67 x 76.44 x 8.82mm (height x width x thickness) . It was launched in Frost Silver, Magnet Black, and and Spruce Green colours.\r\n</p><p>Connectivity options on the Tecno Camon 17P include Wi-Fi, GPS, and USB Type-C. Sensors on the phone include fingerprint sensor.</p>', 740000.00, 740000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, 'pc', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'Tecno Camon 17P (CG7', 'Tecno Camon 17P (CG7) – 6.8″ 128GB ROM 6GB RAM 5000mAh', '200', NULL, 'tecno-camon-17p-cg7-pjda3', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 01:57:46', '2021-07-19 13:58:30'),
(62, 'Tecno Camon 17 Pro CG8', 'admin', 9, 41, 15, '2169,2168', '2168', 'youtube', NULL, 'smartphone,mobile,phone,tecno', '<p>Tecno Camon 17 Pro CG8 8GB RAM 256GB ROM</p><p><br></p><p>Body: 168.9x77.0x9.0mm, 201g; plastic frame.</p><p>Display: 6.80\" IPS LCD, 90Hz, 1080x2460px resolution, 20.5:9 aspect ratio, 395ppi.</p><p>Chipset: Mediatek Helio G95 (12 nm): Octa-core (2x2.05 GHz Cortex-A76 &amp; 6x2.0 GHz Cortex-A55); Mali-G76 MC4.</p><p>Memory: 256GB/128GB storage, 8GB RAM; microSDXC (dedicated slot).</p><p>OS/Software: Android 11, HIOS 7.6.</p><p>Rear camera: Wide (main): 64 MP, f/1.8, 26mm, 1/2.0\", 0.7µm, PDAF; Ultra wide angle: 8 MP, f/2.3, 119˚, 1/4.0\", 1.12µm; Bokeh: 2 MP, f/2.4; Monochrome: 2 MP, f/2.4.</p><p>Front camera: 48 MP.</p><p>Video capture: Rear camera: 4K@30fps, 1080p@30fps; Front camera: 1080p@30fps.</p><p>Battery: 5000mAh; Fast charging 25W.</p><p>Misc: Fingerprint reader (side-mounted); FM radio; 3.5mm jack.</p>', 950000.00, 950000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 1, 0, 0, 'pc', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 'Tecno Camon 17 Pro CG8', 'Tecno Camon 17 Pro CG8 8GB RAM 256GB ROM', '718', NULL, 'tecno-camon-17-pro-cg8-yvnfc', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 01:57:46', '2021-09-09 15:36:39'),
