(122, 'itel it5626', 'admin', 9, 41, 16, '727', '727', 'youtube', NULL, 'itel it5626,itel,phone', '<p>The iTel IT5626 has almost same specs as the iTel Power 700. It is a feature mobile phone and come with a 2500mAh battery that can last about 5 to 8 working days. It has a 2.8-inches screen and measures 139.6 x 57.8 x 14.7mm and come with four bright LED light overhead the phone</p><p>On the inside, the iTel IT5626 is got the UNiSOC SC6531C CPU pegged with 8MB RAM and 8MB ROM. The device support Java+ Opera mini, and come with 2G network with 900/1800 MHz band. It can store upto 2000 contacts and 500 messages and come with 0.08MP lens at the back.</p>', 70000.00, 70000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'itel it5626', 'The iTel IT5626 has almost same specs as the iTel Power 700. It is a feature mobile phone and come with a 2500mAh battery that can last about 5 to 8 working days. It has a 2.8-inches screen and measures 139.6 x 57.8 x 14.7mm and come with four bright LED light overhead the phoneOn the inside, the iTel IT5626 is got the UNiSOC SC6531C CPU pegged with 8MB RAM and 8MB ROM. The device support Java+ Opera mini, and come with 2G network with 900/1800 MHz band. It can store upto 2000 contacts and 500 messages and come with 0.08MP lens at the back.', '727', NULL, 'itel-qvcxi', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 20:44:00'),
