(124, 'itel A14', 'admin', 9, 41, 16, '2186', '2186', 'youtube', NULL, 'itel A14,itel,smart phone', '<p>The itel A14 combines a user-friendly interface with innovative technology and a sleek design in one handy device. A 4 inch android smartphone that will satisfy your daily mobile computing needs.It has a 1.3GHz quad core processor and is equipped with a 2MP back camera and front camera 0.3mp that lets you take lovely pictures with friends and family.\r\n</p><p>Order for it online on Jumia and have it delivered to your doorstep. \r\n</p><p>Impressive View\r\n</p><p>The itel A14 Quad Core Phone has an impressive 4 inch display at an impressive resolution for vibrant and rich colour viewing. You will be able to view pictures and text in high definition whether you are indoors or outdoors. \r\n</p><p>Awesome Processor\r\n</p><p>The quad core processor of this phone will help to support multitasking and a seamless performance. The 1.3GHz processing speed will also allow you stream high definition content from the internet with ease.\r\n</p><p>Display\r\n</p><p>4.0\'\' screen\r\n</p><p>Resolution: 480*800\r\n</p><p>Operating System\r\n</p><p>Android 8.1 ( GO edition)\r\n</p><p>Processor\r\n</p><p>Mediatek 6572\r\n</p><p>Camera\r\n</p><p>Back 2.0 MP\r\n</p><p>Front 0.3 MP\r\n</p><p>Memory\r\n</p><p>8GB HDD\r\n</p><p>512MB RAM\r\n</p><p>up to 32GB flash\r\n</p><p>Connectivity\r\n</p><p>WiFi hotspot\r\n</p><p>Bluetooth\r\n</p><p>USB port\r\n</p><p>Earphone\r\n</p><p>Messaging\r\n</p><p>WhatsApp\r\n</p><p>Palmchat\r\n</p><p>Facebook\r\n</p><p>hotspot\r\n</p><p>Battery \r\n</p><p>Capacity: 1500mAh</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 130000.00, 130000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 'itel A14', 'Itel A14 is a device run on Android 8.1 (Oreo,GO Edition) with 512MB RAM + 8GB ROM,1CARD', '2186', NULL, 'itel-2zjv5', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-09-11 13:44:36'),
(125, 'itel A14 Plus', 'admin', 9, 41, 16, '712', '712', 'youtube', NULL, 'itel A14 Plus,itel,smart phone', '<p>Super Sleek &amp; Stylish DesignThe A14 Plus adopts an elegant and stylish design that is not only modern and trendy but practical and comfortable too! With a curved edge design and a 4” size, this mobile fits perfectly into the palm of one hand.</p><p>Enjoy All Day Usage with the 2500mAh BatteryThe A14 Plus has a 2500mAh big battery that can last for 2-3 days on one single charge! With an 60% increased battery size from the 1500mAh battery, this mobile allows you to enjoy and experience life with no worries!</p><p>A Bigger 16GB MemoryEnjoy 16GB ROM + 512MB RAM with the A14 Plus! Compared with other mobile phones of a similar price range, the A14 Plus has double the storage to ensure you can save all your favourite photos, music and videos.</p><p>Experience and Enjoy Dual FlashCapture natural and charming selfies with our A14 Plus! With Dual Flash and a soft front flash design, this mobile takes stunning selfies every time without hurting your eyes!</p>', 150000.00, 150000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'itel A14 Plus', 'iTel A14 Plus · Display: 4.0 inch 480 x 854 pixels WVGA display · Camera: 2 MP Back / 0.3 MP front · Memory: 512MB RAM / 16GB ROM · Platform: MT6580 CPU', '712', NULL, 'itel-co8tr', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 20:45:55'),
(126, 'itel A16', 'admin', 9, 41, 16, '709', '709', 'youtube', NULL, 'itel A16,itel,smart phone', '<p>The iTel A16 is very similar in design and specifications with the iTel A16 smartphone. And just like the A16, this unit is very cost effective and budget friendly phone from iTel mobile. The device features a 5-inch display with a screen resolution of 480 x 854 pixels and runs on Android v 8.1 (Oreo: Go Edition).\r\n</p><p>Specs wise. the device is powered by a Quad core, 1.3 GHz processor paired with 1 GB of RAM and an expandable 8GB internal storage. You get a 2050 mAh battery juice and just 2MP front and back camera sensors. Other sensors include Accelerometer and Face unlock features</p><p>\r\n</p>', 165000.00, 165000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 1, 'itel A16', 'itel A16 · Processor: Spreadtrum SC7731E · RAM: 512 MB · Storage: 8 GB · Display: 5 in, TN, 480 x 854 pixels, 24 bit · Camera: 2592 x 1944 pixels, 1280 x 720 pixels', '709', NULL, 'itel-gmone', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-10-07 13:40:27'),
(127, 'Itel A35 16GB ROM 1GB RAM', 'admin', 9, 41, 16, '706', '706', 'youtube', NULL, 'Itel A35 16GB ROM 1GB RAM,itel,smart phone', '<p>Better Performance with Android™ 10 (Go edition)\r\n</p><p>With system optimization for entry-level smartphones, the latest Android™ 10 (Go edition) operating system provides 3x more available storage out of the box with fewer pre-installed and much lighter apps.\r\n</p><p>Enjoy a Better and Bigger View with the 5.0”DisplayWith its 5.0” big screen display, A35 offers you an impressive viewing experience when you are watching video or reading news.\r\n</p><p><br></p>', 185000.00, 185000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 1, 'Itel A35 16GB ROM 1GB RAM', 'Better Performance with Android™ 10 (Go edition)\r\nWith system optimization for entry-level smartphones, the latest Android™ 10 (Go edition) operating system provides 3x more available storage out of the box with fewer pre-installed and much lighter apps.\r\nEnjoy a Better and Bigger View with the 5.0”DisplayWith its 5.0” big screen display, A35 offers you an impressive viewing experience when you are watching video or reading news.', '706', NULL, 'itel-tieke', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-10-17 17:41:28'),
(128, 'Itel P15 5.0\" HD Screen, 16GB ROM + 1GB RAM, Android 9', 'admin', 9, 41, 16, '734', '734', 'youtube', NULL, 'Itel P15 5.0\" HD Screen,16GB ROM + 1GB RAM,Android 9,itel,smart phone', '<p>Itel P15 - 5 Inch, 16GB ROM, 1GB RAM, Android 9 Pie(Go edition), 4000mAh, 5MP + 5MP Camera with Front FlashThe specialty of itel P15 is its 4000 mAh big battery. You will hardly ever find such a powerful battery in this price range. 5-inches Full-View display is trendy and large compared to mostly 5-inch displays from other brands. Performance is reasonable and Android Go will further optimize it. You can\'t expect a better performance in this budget.  Again, there are very few phones in this price range with their battery and design as good as the P15. Moreover, the dual 5 MP autofocus back camera is also pretty good for the price. Overall, this smartphone can still be a fine choice for you.\r\n</p><p>Specifications\r\n</p><p>Network Scope 2G, 3G\r\n</p><p>Battery Type &amp; Performance 4000 mAh\r\n</p><p>Weight 0.1kg\r\n</p><p>Camera Factors (Back) LED Flash, autofocus\r\n</p><p>Camera Resolution (Back) Dual 5 Megapixel\r\n</p><p>Camera Resolution (Front) 5 Megapixel\r\n</p><p>Colors Available Champagne Gold, Piano Black\r\n</p><p>Display Size &amp; Resolution 5.0 inches, FWVGA 480 x 960 pixels, (168 ppi)\r\n</p><p>Display Type 18:9 ratio Full-View Touchscreen\r\n</p><p>Graphic Processing Unit (GPU) Mali 400\r\n</p><p>Memory Card Slot MicroSD, up to 32 GB\r\n</p><p>Operating System Android 9 Pie (Go Edition)\r\n</p><p>Processor Quad-Core, 1.3 GHz\r\n</p><p>RAM 2 GB\r\n</p><p>ROM 16 GB\r\n</p><p>Sensors Accelerometer\r\n</p><p>SIM Card Type Dual SIM (Nano-SIM, dual stand-by)\r\n</p><p>USB MicroUSB v2.0\r\n</p><p>Video Recording Yes\r\n</p><p>Wireless LAN Yes\r\n</p><p>Other Features - Bluetooth, GPS, A-GPS, MP3, MP4, Radio, GPRS, Edge, Multitouch, Loudspeaker\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p>', 222000.00, 222000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'itel P15', 'Itel P15 5.0\" HD Screen, 16GB ROM + 1GB RAM, Android 9', '734', NULL, 'itel-dmm6x', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 20:44:14'),
(129, 'Itel A37 – 5.71inches 16GB 1GB RAM', 'admin', 9, 41, 16, '723', '723', 'youtube', NULL, 'Itel A37 – 5.71inches 16GB 1GB RAM,itel,smart phone', '<p>Given that the itel A37 is the successor to the A36, it makes perfect sense to compare the two and see what is new and if upgrading to the newer model is worth it. Both are pretty good phones but at the end of the day you have to choose one and in this case it should be one that ticks all the right boxes for you.\r\n</p><p>In this comparison review, I will highlight some of the key things you get on the new itel A37 and get to see if the upgrade is worth it.\r\n</p><p>The itel A37 comes with a new design concept and a waterdrop notch that houses the front facing camera. The waterdrop notch wasn’t even available on the A36 and gives the phone a screen to body ratio of 84.7%, far higher than the same price phones in the industry.\r\n</p><p>With the waterdrop notch, we are getting a much cleaner look that itel says brings “a natural beauty as well as a gentle touch experience on usage.”\r\n</p><p>Big DisplayAs for the display, the itel A37 comes with a bigger 5.7-inch IPS LCD display with a resolution of 1280 by 720 pixels. With a bigger display, media consumption is pleasant compared to what the itel A36 offered. You get to enjoy the sharper display as well as more vivid photos that add to the overall good experience.\r\n</p><p>The display is not just big but has color rendering effect which is richer and makes the photos and videos pop appearing more vivid and real.\r\n</p><p>Still on the display, there is the eye care mode that lets the screen become soft and warm and this helps reduce strain on your eyes and thus help you fall asleep faster even when you use the phone just before bedtime. Soft lightness is also important for those who spend so much time on their phones as it gives better protection to the eyes.\r\n</p><p>Hardware and ProcessorThe itel A37 is powered by a 1.3 GHz quad-core processor that the company has paired with 1GB of RAM and 16GB of storage space. Performance is good with this and might be better than most other smartphones within its price. The bigger storage space also allows you to save more photos and create memories.\r\n</p><p>The phone also comes with the FREEZER app that ensures that the apps that you do not use regularly are kept in the freezer until you need to use them. With this, the phone will not be slowed down by too many apps as is the case with most other phones. This is usually one of the causes of bad experiences among smartphone users.</p><p>\r\n</p>', 224000.00, 224000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'itel A37', 'Itel A37 – 5.71inches 16GB 1GB RAM', '723', NULL, 'itel-ocb8p', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 20:44:14'),
(130, 'itel A56 1 GB RAM, 16 GB inbuilt · 4000 mAh Battery', 'admin', 9, 41, 16, '707', '707', 'youtube', NULL, 'itel A56 1 GB RAM,16 GB inbuilt · 4000 mAh Battery,itel,smart phone', '<p>The iTel A56 is a low-end smartphone from iTel Mobile. The major selling point of this new little guy is the presence of a large 4000mAh battery. This is same battery capacity used in recent iTel phones, including the iTel P15. But unlike the P15, the A56 comes in a 6.0-inch display with 480 x 960 pixels resolution.\r\n</p><p><br></p>', 250000.00, 245000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 2, 'itel A56', 'itel A56 · Dual Sim, 3G, 4G, VoLTE, Wi-Fi · Quad Core, 1.3 GHz Processor · 1 GB RAM, 16 GB inbuilt · 4000 mAh Battery.', '707', NULL, 'itel-0dj1e', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2022-02-02 15:26:12'),
(131, 'itel A56 Pro 2 GB of RAM and 32 GB of storage', 'admin', 9, 41, 16, '722', '722', 'youtube', NULL, 'itel A56 Pro 2 GB of RAM and 32 GB of storage,a56,itel,smart phone', '<p>Bigger screen for a better experience Submerge in the wonders of the A56 Pro’s new 6\" IPS Full Screen Display. The 18:9 aspect ratio allows you to immerse yourself completely in movies and games. Even under bright sunlight the A56 Pro’s 500 nits super bright display and IPS panel will deliver the best viewing experience possible.\r\n</p><p>Longer duration battery for more freedom Powered by a massive 4000 mAh battery, along with Android’s smart energy-saving chipset, the A56 Pro will never let you down. It can support up to 21 hours of continuous calls, 54 hours of music playback and 8 hours of video playback. This gives you enough energy for a long day\r\n</p><p>Extra big memory for extra big files Never worry about storage. With its expanded memory, the A56 Pro gives you all the space you need for your favorite photos, songs and movies.\r\n</p><p>Compact and slim design Discover a classy and elegant design. The A56 Pro incorporates a rear glass effect and a bright mirror frame with deep reflections and an elegant gradient effect. It’s resistant and slim uni body as well as its curved edge further make it easy to operate and to hold in one hand.\r\n</p><p>Keep your personal information safe with advanced facial recognition Equipped with an infrared light sensor and an infrared camera, facial unlocking is instantaneous and always successful, now even under low light conditions thanks to the Screen Fill Light technology. The face unlock feature is safe and convenient, as it prevents thieves from stealing your information.</p>', 285000.00, 285000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'itel A56 Pro', 'itel A56 Pro is a slightly souped up version, with a bump in RAM and internal memory. The A56 Pro has 2 GB of RAM and 32 GB of storage', '722', NULL, 'itel-dshan', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 20:44:15'),
(132, 'itel P36 ROM: 16GB · RAM: 1GB · REAR CAMERA: 8MP Dual', 'admin', 9, 41, 16, '721', '721', 'youtube', NULL, 'itel P36 ROM: 16GB · RAM: 1GB · REAR CAMERA: 8MP Dual,itel,smart phone', '<p>The iTel is the direct successor of iTel P36 model of last year. The new model come in a refreshed design than it predecessor, and offers newer Android OS out of the box. From the front, the phone sports a 6.5-inch HD+ display with 720 x 1600 pixels, and have same IPS panel with a notch above the screen.\r\n</p><p>On the inside, the new iTel is powered by a quad-core UNISOC SC7731E @1.3GHz, along with Mali-T820 MP1 GPU, 2GB RAM and 32GB of internal storage.\r\n</p><p>For the camera department, you are getting two lenses at the back of the phone, an 8 MP main snapper and a 0.3 MP depth sensing lens, while a single 8-megapixel selfie shooter is left in the notch upfront.\r\n</p><p>There is also a rear placed fingerprint scanner, AI FaceID and a slot for dual SIM cards. The device has a 5000mAh battery on the side, and available in Gradient Purple, Gradient Blue and Dark Blue colors, while Google Android 10 (Go Edition) runs out of the box</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 290000.00, 290000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'itel P36', 'iTel P36 Key Specs · DISPLAY: 6.5 HD+ Waterdrop Fullscreen. · OS: Android Pie (Go Edition). · ROM: 16GB · RAM: 1GB · REAR CAMERA: 8MP Dual', '721', NULL, 'itel-lexpx', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 14:01:28'),
(133, 'Prime Tab 1: Memory: 1GB Ram 32GB built-in storage, with SD-Card, Support up to 32GB', 'admin', 9, 41, 16, '705', '705', 'youtube', NULL, 'Prime Tab 1: Memory: 1GB Ram 32GB built-in storage,itel,smart phone', '<p>Set a Time Limit on App Usage Through the Preloaded Kid Zone AppProtect your kids’ eye by limiting their amount of continuous app usage through the Kid Zone App. This app helps keep kids from playing hours of non-stop gaming without resting in between.</p><p>16GB of ROM Provides Large Storage AvailabilitySave all your favorite content and media on your phone without worrying about running out of memory. 16GB of ROM provides you with plenty of room on your device to store all your photos, songs and videos.</p><p>Take Beautiful Selfies and Portraits on the 5.0MP Rear CameraUse the 5.0MP rear camera and the 2.0MP front camera to capture wonderful moments and memories in real-time. With the assistance of helpful features such as beauty mode, you can continue to take your photography skills to the next level.\r\n</p><p><br></p>', 300000.00, 300000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'Prime Tab 1', 'Itel Prime Tab 1 specs · Display: 7.0-inch, IPS LCD Capacitive Touch Screen · Memory: 1GB Ram 32GB built-in storage, with SD-Card, Support up to 32GB', '705', NULL, 'itel-l0oxg', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 14:02:54'),
(134, 'itel S16 Pro: Memory. 32GB ROM + 2GB RAM (Up to 32GB)', 'admin', 9, 41, 16, '731', '731', 'youtube', NULL, 'itel S16 Pro: Memory. 32GB ROM + 2GB RAM (Up to 32GB),itel,smart phone', '<p>The New Dot-notch DisplayExperiencing a new and innovative 6.6\" HD+ Dot-notch Full Screen with 1600*720 resolution, a 20:9 aspect ratio and a 90% screen-to-body ratio, S16 Pro provides a more fashionable design and a clearer view that is sure to satisfy any user\r\n</p><p>8.3 mm Super Slim Unibody Design for Super Stylish YouThe incredible unibody design provides an extra slim and portable experience whilst ensuring the mobile is splash and dust proof to give owners ultimate protection and peace of mind.\r\n</p><p>New &amp; Improved AI Selfie 2.0Add beauty effects and filters with the AI Face Beauty 3.0, blur the background with the AI Bokeh Effect, capture more detail with the AI Portrait HDR and snap a selfie just by smiling thanks to the smile shot feature!\"Stay Focused\" With AI Triple Rear CameraExperience the 8 mega-pixel main camera that captures stunning quality pictures combined with the 2 mega-pixel macro camera that brings you closer to the subjects that matter. The depth sensing camera can judge distance and depth that takes your photography to a new level!</p>', 340000.00, 340000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 4, 'itel S16 Pro', 'Memory. 32GB ROM + 2GB RAM (Up to 32GB). Battery Capacity. 4000mAh. Operating System. Android™ 10 (Go Edition). Processor. Quad-core 1.3GHz', '174', NULL, 'itel-jnh0r', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 20:46:07'),
(135, 'itel S16 Pro (4G): 2 GB RAM, 32 GB inbuilt; 4000 mAh Battery', 'admin', 9, 41, 16, '710', '710', 'youtube', NULL, 'itel,s16 pro,smart phone', '<p>The New Dot-notch DisplayExperiencing a new and innovative 6.6\" HD+ Dot-notch Full Screen with 1600*720 resolution, a 20:9 aspect ratio and a 90% screen-to-body ratio, S16 Pro provides a more fashionable design and a clearer view that is sure to satisfy any user</p><p>8.3 mm Super Slim Unibody Design for Super Stylish YouThe incredible unibody design provides an extra slim and portable experience whilst ensuring the mobile is splash and dust proof to give owners ultimate protection and peace of mind.\r\n</p><p>New &amp; Improved AI Selfie 2.0Add beauty effects and filters with the AI Face Beauty 3.0, blur the background with the AI Bokeh Effect, capture more detail with the AI Portrait HDR and snap a selfie just by smiling thanks to the smile shot feature!\r\n</p><p>\"Stay Focused\" With AI Triple Rear CameraExperience the 8 mega-pixel main camera that captures stunning quality pictures combined with the 2 mega-pixel macro camera that brings you closer to the subjects that matter. The depth sensing camera can judge distance and depth that takes your photography to a new level!\r\n</p><p><br></p>', 395000.00, 395000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 1, 'itel S16 Pro (4G)', 'Dual Sim, 3G, 4G, VoLTE, Wi-Fi; Quad Core, 1.3 GHz Processor; 2 GB RAM, 32 GB inbuilt; 4000 mAh Battery. 6.6 inches, 1600 x 720 px Display with Punch Hole', '710', NULL, 'itel-hwvjk', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 20:46:07'),
(136, 'itel P37', 'admin', 9, 41, 16, '713', '713', 'youtube', NULL, 'itel P37,itel,smart phone', '<p>The iTel is the direct successor of iTel P36 model of last year. The new model come in a refreshed design than it predecessor, and offers newer Android OS out of the box. From the front, the phone sports a 6.5-inch HD+ display with 720 x 1600 pixels, and have same IPS panel with a notch above the screen.\r\n</p><p>On the inside, the new iTel is powered by a quad-core UNISOC SC7731E @1.3GHz, along with Mali-T820 MP1 GPU, 2GB RAM and 32GB of internal storage.\r\n</p><p>For the camera department, you are getting two lenses at the back of the phone, an 8 MP main snapper and a 0.3 MP depth sensing lens, while a single 8-megapixel selfie shooter is left in the notch upfront.\r\n</p><p>There is also a rear placed fingerprint scanner, AI FaceID and a slot for dual SIM cards. The device has a 5000mAh battery on the side, and available in Gradient Purple, Gradient Blue and Dark Blue colors, while Google Android 10 (Go Edition) runs out of the box</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 315000.00, 315000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'itel P37', 'itel · Search · 5000mAh Big Battery + AI Power Master = Never Run Low on Charge · Explore The World With the 13MP Dual Camera · Worry-free Storage · 4G LTE', '713', NULL, 'itel-bajix', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-07-19 14:05:44'),
(137, 'Itel P37 Pro  32GB Rom 2GB Ram 13MP Camera 5000mAh (4G)', 'admin', 9, 41, 16, '708,1881', '1881', 'youtube', NULL, 'itel P37 Pro (4G),itel,smart phone', '<p>iTel P37 Pro is the higher variant of P37, and the direct upgrade to the P36 Pro LTE version of last year. About upgrade, the P37 Pro is offering a larger display as well as enormous internal storage. The model sports a 6.8-inches IPS screen with 720 x 1640 pixels resolution, while a dewdrop seat above the display.\r\n</p><p>Under the hood, the P37 Pro is powered by an octa-core 1.6GHz UNISOC SC9863A CPU pegged with PowerVR GE8322 GPU. The model has 2GB RAM and 32GB of expandable internal storage. For the software, iTel is still retaining Google Android 10 (Go Edition) out of the box.</p><p>As for the camera setup, you are getting dual sensors on the rear, and a single snapper upfront. The rear module includes a 13-megapixel primary lens along with a secondary AI sensor, while a single 8-megapixel selfie snapper is used in the notch upfront.</p><p>The device supports dual Nano-SIM with 4G LTE network, and available in Gradation Blue, Gradation Sea Blue and Gradient Green. You are also getting a fingerprint scanner on the rear, a 5000mAh battery and the aforementioned Google Android 10 (Go Edition) out of the box</p>', 350000.00, 350000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 1, 'Itel P37 Pro  32GB Rom 2GB Ram 13MP Camera 5000mAh (4G)', 'iTel P37 Pro is the higher variant of P37, and the direct upgrade to the P36 Pro LTE version of last year. About upgrade, the P37 Pro is offering a larger display as well as enormous internal storage. The model sports a 6.8-inches IPS screen with 720 x 1640 pixels resolution, while a dewdrop seat above the display.\r\nUnder the hood, the P37 Pro is powered by an octa-core 1.6GHz UNISOC SC9863A CPU pegged with PowerVR GE8322 GPU. The model has 2GB RAM and 32GB of expandable internal storage. For the software, iTel is still retaining Google Android 10 (Go Edition) out of the box.As for the camera setup, you are getting dual sensors on the rear, and a single snapper upfront. The rear module includes a 13-megapixel primary lens along with a secondary AI sensor, while a single 8-megapixel selfie snapper is used in the notch upfront.The device supports dual Nano-SIM with 4G LTE network, and available in Gradation Blue, Gradation Sea Blue and Gradient Green. You are also getting a fingerprint scanner on the rear, a 5000mAh battery and the aforementioned Google Android 10 (Go Edition) out of the box', '708', NULL, 'itel-f5d4a', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:43:20', '2021-08-16 11:42:04'),
