, NULL, '2021-07-19 02:55:24', '2021-10-10 21:35:19'),
(148, 'Infinix 10 T X689C 128 GB ROM 4GB RAM 4G', 'admin', 9, 41, 14, '948,987', '948', 'youtube', NULL, 'smart phone,infinix,infinix hot 10 t,android,phone', '<p>The New Hot 10T Series the highly anticipated gaming and entertainment smartphone addition to the  Hot 10 portfolio. The Infinix Hot 10T sets a new standard for power, innovation and style by combining sophisticated processing technologies with long-lasting battery performance, a triple camera with Super Nightscape imaging and an ultra-smooth display, encased in a stunning design inspired by nature.\r\n</p><p>The Hot 10T Series features Infinix’s powerful Dar-link optimization engine software, which improves graphic display and touchscreen sensitivity with self-learning AI algorithm capabilities that minimize lag time. With more than 2.7 billion mobile gamers expected by 2023, the Hot 10T smartphone is equipped with a MediaTek Helio G70 chipset to meet the increasing demand for enhanced gaming experiences.\r\n</p><p>Upgraded Design: The Hot 10T adopts pioneering Laser Micron Lithography Technology to create a beautiful shimmer appearance that draws inspiration from the Salar de Uyuni in Bolivia. With smooth-edges and an under-display selfie camera, the Hot 10T is a highly recommended gaming and entertainment device.\r\n</p><p>Buttery-Smooth Display: Boasting a cutting-edge 6.82” HD+ display with 90Hz refresh rate, consumers gain a brilliant viewing experience when watching the latest CGI visual effects. The 180Hz touch sampling rate delivers optimal responsiveness and the intuitive facial recognition enables faster, safer and more convenient device unlocking.\r\n</p><p>Triple 48MP HD Camera with AI: For the first time within the HOT portfolio, the Hot 10T packs a 48MP HD rear camera, an AI camera and a 2MP depth camera with rear Flash. The all-new Super Nightscape feature enables users to take impressive pictures in dark/low-light scenarios while the 2K resolution video recording captures authentic true-to-life footage.\r\n</p><p>MediaTek Helio G70 Chipset: This chipset packs a powerful performance while maximizing battery life for a superior gaming experience. Leveraging innovative dynamic resource management technology, the connectivity powered by MediaTek’s Helio G70 brings faster response times and quicker frame rates. Furthermore, this results in consistent &amp; reliable connectivity which significantly reduces lag time. \r\n</p><p>A 5000mAh Battery: The impressive battery offers 76 hours of calling time on a single charge. Enhanced by power-saving Power Marathon technology that provides an additional 25% power once the battery runs down to 5%, gamers no longer need to think about dreaded battery shutdowns when playing, or embarrassing low battery notifications on video calls. \r\n</p><p>Advanced Software: The DTS Audio processing technology helps elevate sound effects during gameplay. Users can customize the sound effects for better sound quality experiences in games, music and movies. The Infinix XO7.6 is based on Android 11 with a fresh and smarter interface than its predecessor.\r\n</p><p>Dar-link Ultimate Game Booster: The Hot 10T incorporates Infinix’s optimization engine software, the Dar-link Ultimate Game Booster, which works with the smartphone’s hardware to improve the graphic image stability and screen sensitivity.\r\n</p><p>Secured User Privacy: With user data protection and privacy as a priority, two key systems have been implemented into the Hot 10T. X-Proof secures the screen from behind so that user’s screens won’t be snooped on in public, furthermore, all user data on the device stays on the device and is never uploaded to the cloud. In an era when privacy is more prevalent than ever, Infinix has taken extra steps to fully secure it.\r\n</p><p>The Hot 10T features an AI portrait enhancing 8MP front camera to capture sharp images that reflect the results of a professional camera. This camera is the first-ever in the HOT series to offer eye-tracking autofocus, auto-blur videos and face beautification, empowering users to capture the perfect shot. \r\n</p><p>The Hot 10T also features a nightscape 48MP rear HD camera that allows users to take impressive images and videos in both day and night. The 240FPS slow-motion shooting also helps users capture smooth movements for the perfect action shot. \r\n</p><p>The ultimate smartphone entertainment experience with MediaTek’s Helio G70\r\n</p><p>The Hot 10T is the first in its series to be equipped with MediaTek’s Helio G70 chipset to provide an outstanding performance for avid mobile gamers. The octa-core CPU features two powerful Arm Cortex-A75 CPUs operating up to 2GHz and six Cortex-A55 processors operating up to 1.8GHz, interlinked by a large L3 cache for improved performance.\r\n</p><p>MediaTek’s HyperEngine combines various technologies to enhance the overall gaming experience with sustained performance for a longer period. With this feature, gamers can expect smoother performance in demanding game engines, along with intelligent dynamic management of CPU.\r\n</p><p>The Dual 4G SIM support provides exceptional voice and video call quality via VoLTE/ViLTE services, along with faster connection setup time, more reliable coverage and lower power consumption from either SIM connection.\r\n</p><p>The chipset also features built-in integrated voice wake-up capabilities (VoW) that minimize the power of applications in the Android OS, such as the always-on Google Assistant.\r\n</p><p>Play all day with a long-lasting battery\r\n</p><p>To provide users with a non-stop gaming experience, the Hot 10T comes equipped with a battery capacity of 5000mAh. Based on testing from the Infinix data lab, the Hot 10T supports 55 days on standby, 170 hours of music playback, 15.0 hours of continuous gaming or 76 hours of calls on a full charge.\r\n</p><p>The built-in Safe-Charge technology ensures that the power is automatically turned off once the device is fully charged to avoid overheating and wasting energy, while the Power Marathon technology contributes an extra 25% power when the battery runs low – that’s 3.5 hours of additional call time for users.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 609000.00, 609000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'Infinix 10 T X689C 128 GB ROM 4GB RAM 4G', 'Infinix 10 T X689C 128 GB ROM 4GB RAM 4G', '948', NULL, 'infinix-d99of', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:55:24', '2021-07-21 14:23:00');
