(149, 'Infinix Hot 9 Play X680 32GB ROM 2GB ROM 4G', 'admin', 9, 41, 14, '986,985,984', '984', 'youtube', NULL, 'infinix,infinix hot 9 play,smart phone,android', '<p>6000mAh Ultra Battery\r\n</p><p>For Unlimited FunHOT 9 PLAY packs with an ultra battery capacity of 6000mAh to power it. Its stylish design with only 8.90mm thickness brings your unique personality to the next level despite the 6000mAh ultra battery capacity. You can now truly enjoy unlimited fun anytime, anywhere!\r\n</p><p>Enjoy the longer using experiences with the help of the smart power-savingsystem - Battery Lab. It is a unique AI power optimization system that improves overall standby time by approximately 15%.Enjoy the mobile cinema experiences with the 6.82\" larger Cinematic display. The 20.5:9 full view ratio is closer to the IMax movie ratio, enable you to an immersive entertainment experience in movie, gaming and streaming.\r\n</p><p>We have improved the battery quality for HOT 9 Play by enhancing 60% battery lifecycle for a longer durability. A longer battery lifecycle means lesser consumption in resources and every improvement is carefully designed and made for Infinix HOT 9 Play users.\r\n</p><p>Intelligently beautify images with AIBeauty Mode function and create your own beauty style while capturing in this mode.\r\n</p><p>Thanks to DTS audio processing technology, you can level up the sound effect to entertain yourself more. Customize your personalized sound effects to enjoy better sound quality experiences in movies, music, and gaming at any time.\r\n</p><p>The new XOS 6 comes embedded askin on the latest android 10 (has been built on top of android 10). Android 10 is an iteration of Android 9. It comes loaded with better features and is faster, convenient and more efficient.\r\n</p><p>Dark theme is a system wide dark mode that is set to be available on all android 10 featured apps. Dark mode is triggered with a dedication dark theme quick settings button that switches between the default light theme and the new dark theme. It can also be triggered via turning on the battery save mode. It will lead to screen power reduction.\r\n</p><p>HOT 9, the new generation of HOT series, has enhanced the processor upgrade from Quad-core to Octa-core, providing you with better performance to handle your movies, apps, browsing, and more with ease.\r\n</p><p>HOT 9 comes in various colors including Quetzal Cyan, Midnight Black, Violet and Ocean wave with a unique Gem Cut Texture, appealing to the youthful spirit and amplifying the series\' positioning.</p>', 478000.00, 478000.00, 0, '[]', '[]', '[]', '[]', 0, 0, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'Infinix Hot 9 Play X680 32GB ROM 2GB ROM 4G', 'Infinix Hot 9 Play X680 32GB ROM 2GB ROM 4G', '984', NULL, 'infinix-4brq7', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-19 02:55:24', '2021-07-21 14:13:56'),
