(184, 'Hisense tv 50 inches 4k', 'admin', 9, 139, NULL, '1014,1004', '1014', 'youtube', NULL, 'hisense,tv,4k,smart tv,flat', '<p>Hisense 50A7100FS - 50 Inch 4K UHD Smart LED TV - Black\r\n</p><p>The Hisense 50A7100FS 50inch 4K UHD Smart LED TV introduces you to a new age of enchanting 4K resolutions. This resolution is four times as high as a standard Full HD TV! It lends an incredibly realistic picture quality and fantastic blur free motion to enrapture you in your entertainment.\r\n</p><p>The TV maintains a stable performance and high levels of image and audio quality. The audio is brought to you by the powerful Dolby Digital audio technology that makes for mind blowing, theater like immersion. The TV is also endowed with futureproof 4K technologies, such as HDMI and USB ports, and well as a vast array of external ports. \r\n</p><p>The HDMI port offers connectivity to support external devices like gaming consoles and more. This enables faster moving images and colors that look rich and vibrant. If you have a Netflix membership, you can enjoy TV shows and movies on this wide screen as it supports this Internet subscription service. Plus, with support for WiFi, you can connect to all your favorite apps and other smart features.\r\n</p><p>A WIDER VIEWING EXPERIENCE\r\n</p><p>The Hisense 50A7100FS is a 50inch 4K UHD Smart LED TV. It offers a deeper viewing experience by immersing you in vivid, accurate detail. This large screen also provides a wider field of view, along with a wide viewing angle with excellent clarity, contrast, and color saturations.\r\n</p><p>BRING THE WORLD CLOSER\r\n</p><p>Experience the purest colors and crystal clear images on this 50inch LED 4K UHD Smart TV from Hisense. It supports four times the resolutions of conventional Full HD and brings to your living room true to life imagery. With such high resolutions, you get to experience amazing picture quality, colors, and contrast.</p><p>\r\n</p>', 1300000.00, 1300000.00, 0, '[]', '[]', '[]', '[]