(260, 'Coconut Oil 150ml', 'admin', 9, 92, NULL, '1113', '1113', 'youtube', NULL, 'coconut oil,shampoo,oil,hair oil', '<p>Sultana Coconut oil Extra Pure 150ml&nbsp;</p><p>Coconut oil is pretty much the holy grail of hair oil. It acts as a heat protectant, repairs damaged hair and breakage, helps to prevent hair loss, as well as aids in hair growth. Because of its moisture retaining properties, coconut oil stays inside the hair instead of evaporating, making it one of the most effective hair treatments there is.</p><p>How to use: After bath,dry your hair and apply right  amount unto hair to the root until its completely absorbed. Do this twice a day morning and evening for maximum results. If you have dandruff its gone</p>', 7000.00, 4500.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '10', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'Coconut Oil 150ml', 'Sultana Coconut oil Extra Pure 150ml&nbsp;Coconut oil is pretty much the holy grail of hair oil. It acts as a heat protectant, repairs damaged hair and breakage, helps to prevent hair loss, as well as aids in hair growth. Because of its moisture retaining properties, coconut oil stays inside the hair instead of evaporating, making it one of the most effective hair treatments there is.How to use: After bath,dry your hair and apply right  amount unto hair to the root until its completely absorbed. Do this twice a day morning and evening for maximum results. If you have dandruff its gone', '1113', NULL, 'bodycare-nfila', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-23 20:42:47', '2021-07-23 21:16:08'),
