(327, 'Hisense BUILT IN OVEN BSA5221 BLACK COLOR OVEN', 'admin', 9, 127, 17, '1170,1163,1154', '1178', 'youtube', NULL, 'hisense,oven,black', '<p><b>A rounded shape for an Even Bake.\r\n</b></p><p>The Even Bake shape cooks every dish perfectly. Based on traditional wood-burning ovens, this rounded design ensures hot air circulates freely, heating food evenly so that everything you cook is perfectly done – crispy on the outside, juicy on the inside.</p><p><b>Bake the best bread with the Steam Add function.\r\n</b></p><p>With the Steam Add function simply add water to a tray and chose one of three variable settings depending on the level of steam you need. Then set the desired oven temperature. The water evaporation from the steam creates a moist environment, as opposed to just hot air, allowing for the ideal environment for any dough to bake to perfection.</p><p><b>Steam Clean breaks dirt down quickly and easily.\r\n</b></p><p>Loosen grease and stains quickly and easily. Place a water filled baking tray in the oven, select Steam Clean and after only 30 minutes, grease and marks can be wiped off the stain resistant enamel with ease.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 1220000.00, 1220000.00, 0, '[]', '[]', '[]', '[]', 0, 0, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'Hisense BUILT IN OVEN BSA5221 BLACK COLOR OVEN', 'A rounded shape for an Even Bake.\r\nThe Even Bake shape cooks every dish perfectly. Based on traditional wood-burning ovens, this rounded design ensures hot air circulates freely, heating food evenly so that everything you cook is perfectly done – crispy on the outside, juicy on the inside.Bake the best bread with the Steam Add function.\r\nWith the Steam Add function simply add water to a tray and chose one of three variable settings depending on the level of steam you need. Then set the desired oven temperature. The water evaporation from the steam creates a moist environment, as opposed to just hot air, allowing for the ideal environment for any dough to bake to perfection.Steam Clean breaks dirt down quickly and easily.\r\nLoosen grease and stains quickly and easily. Place a water filled baking tray in the oven, select Steam Clean and after only 30 minutes, grease and marks can be wiped off the stain resistant enamel with ease.\r\n\r\n\r\n', '1178', NULL, 'hisense-yupoh', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-24 16:55:34', '2021-10-16 08:47:29'),
