(396, 'Stabex 6kg Fullset', 'admin', 9, 132, NULL, '1313,1315,1311,1312,1318,1317', '1315', 'youtube', NULL, 'stabex,gas,gas cooker,cylinder,gas cylinder', '<p>Stabex now offers a fully fledged LPG brand  through its extensive retail and distribution networks across the region. The new LPG product range offers customers quality, safe and reliable gas. Our main goal is to contribute towards the United Nations Sustainable Development Goals (UN-SDG) through distribution of our LPG at affordable prices to the last mile.\r\n</p><p><b>STABEX LPG HEALTH AND SAFETY TIPS\r\n</b></p><p>1). Ensure you buy from authorized dealers/outlets or a Stabex Service Station near you.\r\n</p><p>2). Check the test date to determine if the cylinder is valid.\r\n</p><p>3). Ensure the cylinder has operating guidelines and safety sticker.\r\n</p><p>4). Confirm the weight of the gas before purchase.\r\n</p><p>5). Ensure the gas cylinder is sealed before issuance.\r\n</p><p><b>BENEFITS OF STABEX GAS\r\n</b></p><p>1). Readily available across the region in our service stations, major supermarkets and authorized dealers/outlets.\r\n</p><p>2). Safe, clean and convenient cooking.\r\n</p><p>3). Reasonably priced.\r\n</p><p>4). Spotless kitchen, cooking with Stabex gas does not leave behind thick puffs of smoke, soot or residue.\r\n</p><p>5). Simpler to switch off the burner after use.\r\n</p><p>6). Easy refill.\r\n</p><p>7). Burns consistently making it more reliable.\r\n</p><p>8). Door to door delivery on request and after service.\r\n</p><p>9). Easy to handle with instantaneous on/off knob that offers better control as you cook through flame regulation.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 135000.00, 135000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, 'flat_rate', NULL, 0, NULL, 0, 'Stabex 6kg Fullset', 'Stabex now offers a fully fledged LPG brand  through its extensive retail and distribution networks across the region. The new LPG product range offers customers quality, safe and reliable gas. Our main goal is to contribute towards the United Nations Sustainable Development Goals (UN-SDG) through distribution of our LPG at affordable prices to the last mile.\r\nSTABEX LPG HEALTH AND SAFETY TIPS\r\n1). Ensure you buy from authorized dealers/outlets or a Stabex Service Station near you.\r\n2). Check the test date to determine if the cylinder is valid.\r\n3). Ensure the cylinder has operating guidelines and safety sticker.\r\n4). Confirm the weight of the gas before purchase.\r\n5). Ensure the gas cylinder is sealed before issuance.\r\nBENEFITS OF STABEX GAS\r\n1). Readily available across the region in our service stations, major supermarkets and authorized dealers/outlets.\r\n2). Safe, clean and convenient cooking.\r\n3). Reasonably priced.\r\n4). Spotless kitchen, cooking with Stabex gas does not leave behind thick puffs of smoke, soot or residue.\r\n5). Simpler to switch off the burner after use.\r\n6). Easy refill.\r\n7). Burns consistently making it more reliable.\r\n8). Door to door delivery on request and after service.\r\n9). Easy to handle with instantaneous on/off knob that offers better control as you cook through flame regulation.', '1315', NULL, '-gbttr', 0.00, NULL, 0, 0, NULL, NULL, '2021-07-28 13:06:28', '2021-07-28 15:55:16'),
