(712, 'Sayonapp SHT-1079BT 2.1 Channel 10000W PMPO Subwoofer - Black', 'admin', 9, 142, NULL, '1895,1897,1898', '1898', 'youtube', NULL, 'speakers,sayonapp,woofers', '<p>014 - Sayona SHT-1079BT 2.1 Channel 10000W PMPO Subwoofer - Black</p><p>Sayona Subwoofer 2.1 Channel has a High Tech Multimedia Super bass surround woofer with an Active speaker system 2.1Channel Speaker System. Sayona Subwoofer 2.1 Channel supports  USB, SD Card and FM Radio. Sayona Subwoofer 2.1 Channel comes with a Remote Control.</p><p>Sayona SHT-1079 BT Channel 2.1 10000W Subwoofer The compact unit adds style to your living room. The subwoofer plays loud music with unmatched clarity. The subwoofer fits in any room and also fits in your wallet as it is cheap.</p><p><br></p><p>Features:</p><p><br></p><p>Brand: Sayona</p><p>Model: SHT-1079BT</p><p>Aux/FM ready</p><p>Bluetooth</p><p>USB Support</p><p>Aux/Digital FM ready</p><p>Equalizer functionality</p><p>Compatible with DVD, CD, MPEG-4, MP3 &amp; WMA</p><p>PMPO Output: 10000W PMPO</p>', 330000.00, 330000.00, 0, '[]', '[]', '[]', '[]', 1, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 1, 'Sayona SHT1222BT- 3.1 Channel 16000W PMPO Subwoofer - Black', '14', '1898', NULL, 'tech-f7gnu', 0.00, NULL, 0, 0, NULL, NULL, '2021-08-16 14:05:03', '2021-10-04 14:45:26'),
