(714, 'Oraimo OEP-E23 Vortex Bass Wired Eearphone - Black', 'admin', 9, 143, NULL, '1887,1883,1884', '1884', 'youtube', NULL, 'oraimo oep,bass speaker', '<p>014 -&nbsp;</p><p>Simple Retailers oraimo pure bass OEP-E23 ,  single -button remote ,comfortable ,extra base, bright treble cable length 1.2m original product. Designed to be used on the move, the OEP-E23 acclaimed drivers are made for richly detailed and well balanced sound. The Aircraft Grade Aluminium and Fabric Braided Cables are just some of the most impressive features of these In-Ears, ensuring durability and longevity even with the most rough use.</p><p><br></p><p>The earphones is small enough to put into any pocket and carry it to anywhere. The well-designed earbuds which can let you immerse yourself in stereo music for a long time. Headphone ergonomically aluminum metal cavity designed, the before cavity of the minor arc design can be more fit the ear canal, and further ease the pressure on the ear canal, wearing more comfortable and natural, long period of use will not feel discomfort; Powerful neodymium magnet unit design, with Noise isolating hi-definition technology, super bass, You will enjoy the excellent sound. Headphone with a microphone, Facilitate the user to answer the telephone and Internet voice calls.</p><p><br></p><p>It uses the most fashion flat TPE cable (like noodles), Tension, non-toxic and safety for environmental, the cable is very soft, increase feel and not knotted characteristics, not deformed, stretching mild pull will not damage, 3.5mm line type plug for the three-stage design (also known as Apple plug), applies to any smartphone, 24K gold plating process designed to ensure that the signal transmission without distortion, the sound is more pure and transparent. 10mm super powerful driver unit, loud volume, strong amplifier. Stress volume setting technology and 106dB high sensitivity bring you wonderful music experience. Sound Excellent super bass stereo sound, Canvas round bar cable design 1.2m length cable can meet your different demands such for iPod, for iPhone, bring more convenience for you. It’s a perfect gift for a lover, friends, kids, elder, employee and so on.</p><p><br></p><p>Key Features:</p><p><br></p><p>Cable Length: 1.2m</p><p>Frequency Response: 20-20000Hz</p><p>Impedance: 16 OMS</p><p>Sensitivity: 105+/-3dB</p><p>Plug Type: 3.5mm</p><p>Earphone Specify: In ear</p>', 27000.00, 27000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 1, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 'Oraimo Highway OCC-21D USB Fast Car Charger', '14', '1883', NULL, 'tech-kkibs', 0.00, NULL, 0, 0, NULL, NULL, '2021-08-16 14:05:03', '2021-09-14 17:33:08'),
