(761, 'Canon G3400', 'admin', 9, 54, NULL, '2040,2031', '2031', 'youtube', NULL, 'canon,printer', '<p>PIXMA G3400\r\n</p><p>A Wi-Fi &amp; Cloud enabled multi-functional printer, with high yield ink bottles, allowing you to create low cost stunning prints for both documents and photos at home or in the office.\r\n</p><p>Benefits\r\n</p><p>A wireless multi-function high yield document and photo printer\r\n</p><p>Colour: 7,000 pages. Black: 6,000 pages*\r\n</p><p>Wi-Fi printing from smart devices with Canon’s PRINT app and PIXMA Cloud Link.\r\n</p><p>4x6” borderless photos in approx. 60 secs\r\n</p><p>High volume cost effective printing.\r\n</p><p>Detailed Features\r\n</p><p>Take a more detailed look into the Canon PIXMA G3400\r\n</p><p>Connected High Yield Printing, Copying and Scanning\r\n</p><p>With built in Wi-Fi, the PIXMA G3400 is perfect for use within home, home office and small business environments, whether you are printing documents or photos. Our multi-function device comes with unrivalled page yields of Colour: 7,000 pages. Black: 6,000 pages*, meaning you can enjoy significant savings with low printing costs.\r\n</p><p>Canon PRINT app/ Wi-Fi printing\r\n</p><p>Easily print from anywhere, as the PIXMA G3400 is Wi-Fi enabled, allowing you to print wirelessly from your PC, and smart devices through our ‘Canon PRINT app’. So you don’t have to install new software to get your printing underway.\r\n</p><p>PIXMA Cloud\r\n</p><p>With our PIXMA Cloud service you can access online services such as Google Drive, Evernote, Dropbox and OneDrive. We also know that social media plays a huge part in the sharing of information, so we’ve made it possible for you to print from such sites as Facebook and Instagram.\r\n</p><p>Pigment black ink &amp; dye colour inks\r\n</p><p>Improve the quality of your prints with our high quality pigment black ink and colour dyes, to aid you in creating stunningly sharp texts and gorgeously vibrant images. Also allowing you to enjoy printing borderless 4 x 6” photos in approximately 60 seconds.\r\n</p><p>Integrated Ink Tanks\r\n</p><p>The PIXMA G Series has been built with design at its forefront, our front facing ink tanks are easy to replenish making it simple to track ink levels, ensuring that you’re never caught off guard. While our compact and sleek designs allows for full integration into a home/office environment.\r\n</p><p>Reliable Components for High Volume Printing\r\n</p><p>We’ve worked to ensure that our printing system remains stable during high volume printing through enhancements in our FINE print head and technology which ensures air does not penetrate into the ink tube system.\r\n</p><p>*Page yield is the estimated value based on Canon individual test method using the ISO/IEC 24712 chart &amp; continuous printing simulation with the replacement ink bottles after initial setup. Page yields are not to be combined.\r\n</p><p>Product Specification\r\n</p><p>Find out more about the Canon PIXMA G3400, its features and what it can do.\r\n</p><p>Borderless Printing\r\n</p><p>Borderless Printing\r\n</p><p>High page yield\r\n</p><p>Print high volume documents and photos\r\n</p><p>High Ink System\r\n</p><p>Pigment black and dye colour inks\r\n</p><p>4800dpi\r\n</p><p>High resolution photo printing\r\n</p><p>Integrated Ink Tanks\r\n</p><p>Easy to refill ink tanks\r\n</p><p>2pl\r\n</p><p>Micro ink droplets for precise printing\r\n</p><p>Wireless Printing\r\n</p><p>Print from wireless devices\r\n</p><p>Smartphone and Tablet\r\n</p><p>Print from popular cloud services</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>	\r\n</p><p>\r\n</p>', 860000.00, 860000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, NULL, 0.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 'Canon G3400', '17', '2031', NULL, '-kpv2h', 0.00, NULL, 0, 0, NULL, NULL, '2021-08-30 12:28:37', '2021-09-09 15:29:47'),
