al for our body and comfortable rest is good for our health. Hisense air conditioners adapt to everyone\'s sleep.\r\n\r\nAuto vertical airflow adjustment\r\n\r\nSuper Cooling: By selecting the Super function from the remote control, the air conditioner quickly reduces the temperature in the room, increasing the cooling capacity by 25%.\r\n\r\nSMART function: If you press the Smart button on the remote control, the air conditioner will work in the most comfortable mode according to the room temperature\r\n\r\nSpecial 8°C restart: The special 8°C warm-up mode is very useful especially for homes located in areas with colder temperatures (and in second homes). During your absence, in fact, the unit will start in heating mode as soon as it detects a temperature below 8°C allowing your rooms not to freeze and reducing the level of humidity in the air.\r\n\r\nAuto Restart\r\n\r\nDimmer\r\n\r\ni-FEEL function: The sensor inside the remote control is able to detect the surrounding temperature and transmit this information to the indoor unit. The indoor unit operates according to the detected temperature. The intelligent temperature control ensures a more comfortable environment and a more precise temperature control, saving energy.\r\n\r\nTimer 24h: In Hisense air conditioners this function allows you to select the time to turn on and off the air conditioner over a period of 24 hours.\r\n\r\nRemote control with backlit display\r\n\r\nRemovable and washable panel\r\n\r\nActivated carbon filter\r\n\r\nEvaporator anti-bacteria\r\n\r\n\r\n\r\nTechnical features\r\n\r\n\r\n\r\n\r\n\r\nCooling\r\n\r\n\r\n\r\nMin/Max capacity: 5.0 KW 1.0/6.00\r\n\r\nNominal input power: kW 1.54 (0.26-2.3)\r\n\r\nSEER 6,1\r\n\r\nEnergy Class: A++\r\n\r\nEER 3.25\r\n\r\nIndicative annual energy consumption kW/a 287\r\n\r\nHeating\r\n\r\n\r\n\r\nMin/Max capacity: 5.6 KW 1.6-6.25\r\n\r\nNominal input power: 1.55 (0.35-2.3)\r\n\r\nSCOP: 4.0\r\n\r\nSeasonal energy efficiency class A+\r\n\r\nCOP 3.61\r\n\