(999, 'Hisense tv 43 inch Smart TV', 'admin', 9, 140, NULL, '1024,1022', '1024', 'youtube', NULL, 'tv,television,flat tv,flat screen,43 inch,smart tv', '<p>Be prepared to imagine a new era of television with the Hisense Smart TV. Be connected to thousands of movies, music and games on the brilliant TV display. Let yourself go wherever your imagination can take you with the Hisense Smart TV experience.</p><p><br></p><p>43\" LED DisplayThe Hisense 43 inch FHD LED TV’s makes a perfect addition to contemporary rooms. When switched on, the backlit LED screen churns out images and videos with amazing contrast and details.</p><p><br></p><p>USB Ports ConnectivityThe Hisense 43-inch FHD LED TV is designed to support virtually all the latest peripheral gadgets. The TV features two USB 2.0 ports, to which you can connect your DVD players, cameras, external hard drives, and more. Now you can enjoy all your multimedia content of these gadgets on the big screen, right from the comfort of your couch.</p><p><br></p><p>Technical Specifications</p><p>Display•Backlight System: Direct LED•Brightness (cd/m.sq): 300•Native Contrast Ratio: 4000:1•Panel Resolution: 1080ppi•Response Time(ms): 8ms(Grey to Grey)•Viewing Angle: 164°/124°</p><p>Smart TV•Wireless Inside: Yes•Facebook App: Yes•Twitter App: Yes</p><p>Digital Multimedia Player•Play back multiple audio &amp; video files   from external USB storage: Yes•Music Playback:     Yes•Display Photos:     Yes•Video Playback: Yes</p><p>Reception System•Auto Tune Setup Wizard: Yes•AV Colour Sytem: PAL</p><p>Audio•MAX Audio Output (RMS): 2 x 10watts•Dolby Digital: Yes•Automatic volume level (AVL): Yes•Sound Equalizer: Yes•Audio Enhancement: dbx-TV</p><p>Terminal Inputs/Outputs•MHL (shared with HDMI)•HDMI•HDMI CEC•Ethernet / LAN Input•Optical/ Digital Audio Output (SPDIF) USB Ports•AV Input (Audio &amp; Video)•Component Input (YPbPr)•Headphone (3.5 mm)•RF Tuner</p><p>Key Features•Screen Size: 43\" •Brand: Hisense •Colour: Black•Durable TV•Condition: 100% new•Resolution: 1080ppi•Inbuilt free to Air Digital Decoder •Smart TV with Built-in WIFI•HDMI Allows Multiple HD Connections•D-LED Technology.•High Contrast Ratio for “Blacker” Blacks &amp; Brighter Colors</p><p><br></p><p>What’s in the boxHisense 43\" Smart TVRemote Contol User manual</p><p>\r\n</p><p>\r\n</p>', 1400000.00, 1040000.00, 0, '[]', '[]', '[]', '[]', 0, 1, 1, 'quantity', 1, 0, 0, 0, '5', 1, NULL, 80000.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 'Hisense tv 43 inch Smart TV', 'Hisense 43\" Frameless Digital TV - Black\r\nThe 43\" backlit LED panel of the television produces eye catching HD resolution images that are simply stunning to look at. This TV also has a number of ports to keep you well connected at all times, and theseinclude the USB and HDMI ports. \r\n43\" LED DisplayThe Hisense 43 inch HD LED TV’s makes a perfect addition to contemporary rooms. When switched on, the backlit LED screen churns out images and videos with amazing contrast and details.\r\nHigh Definition TVThe Hisense 43\" HD LED display generates amazingly clear, razor sharp images with a resolution of full HD. More over, it comes with the latest DVB-T2 technology for the best &amp; clearest digital TV signals so you can enjoy in-built free local TV channels off the box.\r\nDigital LED TechnologyWitness the entire RCG spectrum brought to life on your screen. The Hisense LED TV brings you exceptionally vibrant and true-to-life images delivered just as the director imagined.\r\nUSB Digital Media PlayerProvides you the flexibility to enjoy not only photos or music, but also HD multimedia files directly in your TV via USB. Explorer More Connectivity OptionsThe TV features 1 USB 2.0 ports, and 3 HDMI ports to which you can connect your DVD players, cameras, external hard drives, and more. Now you can enjoy all your multimedia content of these gadgets on the big screen, right from the comfort of your couch. It also features audio input.\r\nTechnical Specifications\r\nDisplay•Technology: LED•Screen Size: 43 Inches •Resolution: Full HD•Display Ratio: 16:9; UHD Ready\r\nAudio•MAX Audio Output (RMS): 6W + 6W•Dolby Digital•Sound Equalizer•Audio File Format: MP3, AAc, M4A, WAV \r\nVideo:AV Colour Format: PAL, NTSC, SECAMComponent Mode: 480i/60Hz, 480p/60Hz, 576i/50Hz, 576p/50Hz, 720p/50Hz, 720p/60Hz, 1080i/50Hz, 1080i/60Hz, 1080p/50Hz, 1080p/60HzVGA Mode: 640 x 480, 800 x 600, 1024 x 768, 1280 x 1024 - 60HzHDMIMode: 480i/60Hz, 480p/60Hz, 576i/50Hz, 576p/50Hz, 720p/50Hz, 720p/60Hz,1080i/50Hz, 1080i/60Hz, 1080p/50Hz, 1080p/60Hz. 640 x 480, 800 x 600, 1024 x 768 - 60HzUSB Video Format: AVI, MKV, FLV, TS, MP4Photo Format: JPEG\r\nConnectivity:•HDMI: 3•USB: 1•Optical Output: 1 •Audio Jack: 1•AV Input: 1\r\nFeatures:•Narrow Frame•Digital Media player•Digital High Definition Tuner\r\nTelevision System:•PAL/SECAM-B/G,D/K DVB-T+C DVB-T2  DVB-S/S2•PVR, DV3 Digital Receiver\r\nPower•Energy Efficiency class A + •Power Supply: AC 220-240V 50/60Hz •Power Consumption On-Mode: 30W•Annual Energy Consumption: 44 kWh per year on 4 hours operation for 365 days.\r\nNote:Due to the difference between different monitors, the picture may not reflect the actual color of the item. We guarantee the style is the sameas shown in the pictures. Thank you!Make your order here today and have Jumia Uganda deliver it right at your most convenient picking point or doorstep\r\nPlease enjoy more shopping of wide range of items at affordable prices on our store at www.jumia.ug\r\nKey Features•Ultra High Definition•Full HD Streaming•USB Video•Screen Size: 43 Inches •Display Technology: LED•Digital DVB-T2 Ready•Resolution: full HD Ready', '1024', NULL, 'hisensetv-rv6jy', 0.00, NULL, 0, 0, NULL, NULL, '2021-10-24 13:12:39', '2021-10-24 13:15:49'),
