(1001, 'STAR TIMES Decoder, Antenna + 1 Month Subscription Package', 'admin', 9, 183, NULL, '2546,2547,2544,2545', '2546', 'youtube', NULL, 'FULL SET,star times,decorder,antenna', '<p>StarTimes is the leading digital TV operator in Africa, serving nearly 20 million users with a signal covering the whole continent and a massive distribution network of 200 brand halls, 3,000 convenience stores and 5,000 distributors. StarTimes owns a featured content platform, with 480 authorized channels consisting of news, movies, series, sports, entertainment, children\'s programs, etc. The company\'s vision is \"To ensure that every African family can access, afford, watch and share the beauty of digital TV\". StarTimes achieves this by combining setellite and terrestrial DTV systems as well as OTT services to provide an open and secure digital wireless platform. The company provides a robust signal transmission service for public and private broadcasters, offers consumers outstanding Pay-TV programs, mobile multimedia, wireless Internet connectivity and convenient online services.</p><p><br></p><p>Africa’s leading pay-TV operator StarTimes has acquired exclusive broadcasting rights for UEFA Europa League in Sub-Saharan Africa until 2021.This season will be intense for football fans with Bundesliga, French Ligue 1, FIFA Club World Cup, French &amp; Italian Cups and now UEFA Europa League.”</p>', 180000.00, NULL, 0, '[]', '[]', '[]', NULL, 0, 1, 1, 'quantity', 1, 0, 0, 0, '1', 1, 1, 50000.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 'STAR TIMES Decoder, Antenna + 1 Month Subscription Package', 'StarTimes is the leading digital TV operator in Africa, serving nearly 20 million users with a signal covering the whole continent and a massive distribution network of 200 brand halls, 3,000 convenience stores and 5,000 distributors. StarTimes owns a featured content platform, with 480 authorized channels consisting of news, movies, series, sports, entertainment, children\'s programs, etc. The company\'s vision is \"To ensure that every African family can access, afford, watch and share the beauty of digital TV\". StarTimes achieves this by combining setellite and terrestrial DTV systems as well as OTT services to provide an open and secure digital wireless platform. The company provides a robust signal transmission service for public and private broadcasters, offers consumers outstanding Pay-TV programs, mobile multimedia, wireless Internet connectivity and convenient online services.Africa’s leading pay-TV operator StarTimes has acquired exclusive broadcasting rights for UEFA Europa League in Sub-Saharan Africa until 2021.This season will be intense for football fans with Bundesliga, French Ligue 1, FIFA Club World Cup, French &amp; Italian Cups and now UEFA Europa League.”', '2543', NULL, 'dstv-full-kit-1rqpc', 0.00, NULL, 0, 0, NULL, NULL, '2021-10-24 13:56:08', '2021-10-26 12:27:13'),
(1002, 'Gotv Decoder + Antenna', 'admin', 9, 183, NULL, '2546,2547,2544,2545', '2546', 'youtube', NULL, 'FULL SET,star times,decorder,antenna', '<p>Gotv is a pay TV service offered in Africa by Multichoice Africa. Unlike the other pay TV service from Multichoice Africa (DSTV), which is setellite based, Gotv is terrestrial digital TV service. So, no need for dish and ceremonial installation, leading to reduced access cost. Gotv is currently available in select cities in Nigeria, Zambia, Uganda, Ghana, Malawi, Namibia, Zimbabwe, and Kenya.</p><p><br></p><p>Digital TV with no dish required. it s network is nation wide</p><p><br></p><p>GOtv utilises the latest Digital Terrestrial Broadcast Technology, The broadcast method is similar to that used by the likes of NTA and AIT, but is digital with better quality audio and video. Perhaps the closest service to Gotv is Startimes, a digital pay TV service based on</p><p><br></p><p>Gotv Coverage</p><p><br></p><p>Gotv is a digital terrestrial TV service, not setellite TV. So, the service is deployed through TV masts and accessible only in locations with GOtv transmitter coverage. Currently GOtv is available in the following cities in Nigeria and in some cases their environs: Lagos, Enugu, Ibadan, Abeokuta, Benin City Owerri, Akwa Ibom, and Port Harcourt.</p><p><br></p><p>The major advantage of the GOtv setup is that no setellite dish is required leading to low/zero installation cost. It is plug n play, so you can install it yourself. Any TV antenna can be used for receiving the GOtv signals.</p><p><br></p><p>Gotv Prices</p><p><br></p><p>The decoder comes with an outdoor antenna (a.k.a GOtenna), which offers better reception with better quality video and audio.</p><p><br></p><p>Initial Gotv access cost  varies Naira for decoder, outdoor antenna, remote, and 1 month free Gotv plus package.</p><p><br></p><p>No dish, means that GOtv is not affected by weather easily as the case with pay TV setellite services like DSTV.</p><p><br></p><p>GOtv Channels &amp; Packages</p><p><br></p><p>GOtv offers two pay bouquets, namely the GOtv standard package, which offers 25 channels and goes for N1,250 per month and GOtv Plus package, which has 38 channels is priced at N1,800 monthly.</p><p><br></p><p>There is also the GOtv Open which currently offers up to 7 free to air channels free once you pay a one-off non-refundable 6,600 Naira administrative fee.</p><p><br></p><p>Some channels available on the GOtv package include:</p><p><br></p><p>Africa Magic (World, Movies, Yoruba, Hausa)</p><p>Al Jazeera</p><p>BET</p><p>Discovery World</p><p>E! Entertainment</p><p>KidsCo</p><p>Channel O</p><p>Supersport Select Sport</p><p>Sony Max</p><p>Sound City</p><p>Style Network</p><p>Silverbird</p><p>AIT</p><p>NTA</p><p>and so on</p><p>GOtv Plus features all GOtv channels with some exclusive channels. Some exclusive channels on GOtv Plus include:</p><p><br></p><p>CNN</p><p>Disney Junior</p><p>MTV Base</p><p>Telemundu</p><p>National Geographic Wild</p><p>Sony Entertainment TV</p><p>Supersport Blitz</p>', 100000.00, NULL, 0, '[]', '[]', '[]', NULL, 0, 0, 1, 'quantity', 1, 0, 0, 0, '1', 1, 1, 50000.00, 'amount', 0, 0, NULL, NULL, NULL, NULL, 0, NULL, 0, 'STAR TIMES Decoder, Antenna + 1 Month Subscription Package', 'Gotv is a pay TV service offered in Africa by Multichoice Africa. Unlike the other pay TV service from Multichoice Africa (DSTV), which is setellite based, Gotv is terrestrial digital TV service. So, no need for dish and ceremonial installation, leading to reduced access cost. Gotv is currently available in select cities in Nigeria, Zambia, Uganda, Ghana, Malawi, Namibia, Zimbabwe, and Kenya.\r\n\r\nDigital TV with no dish required. it s network is nation wide\r\n\r\nGOtv utilises the latest Digital Terrestrial Broadcast Technology, The broadcast method is similar to that used by the likes of NTA and AIT, but is digital with better quality audio and video. Perhaps the closest service to Gotv is Startimes, a digital pay TV service based on\r\n\r\nGotv Coverage\r\n\r\nGotv is a digital terrestrial TV service, not setellite TV. So, the service is deployed through TV masts and accessible only in locations with GOtv transmitter coverage. Currently GOtv is available in the following cities in Nigeria and in some cases their environs: Lagos, Enugu, Ibadan, Abeokuta, Benin City Owerri, Akwa Ibom, and Port Harcourt.\r\n\r\nThe major advantage of the GOtv setup is that no setellite dish is required leading to low/zero installation cost. It is plug n play, so you can install it yourself. Any TV antenna can be used for receiving the GOtv signals.\r\n\r\nGotv Prices\r\n\r\nThe decoder comes with an outdoor antenna (a.k.a GOtenna), which offers better reception with better quality video and audio.\r\n\r\nInitial Gotv access cost  varies Naira for decoder, outdoor antenna, remote, and 1 month free Gotv plus package.\r\n\r\nNo dish, means that GOtv is not affected by weather easily as the case with pay TV setellite services like DSTV.\r\n\r\nGOtv Channels & Packages\r\n\r\nGOtv offers two pay bouquets, namely the GOtv standard package, which offers 25 channels and goes for N1,250 per month and GOtv Plus package, which has 38 channels is priced at N1,800 monthly.\r\n\r\nThere is also the GOtv Open which currently offers up to 7 free to air channels free once you pay a one-off non-refundable 6,600 Naira administrative fee.\r\n\r\nSome channels available on the GOtv package include:\r\n\r\nAfrica Magic (World, Movies, Yoruba, Hausa)\r\nAl Jazeera\r\nBET\r\nDiscovery World\r\nE! Entertainment\r\nKidsCo\r\nChannel O\r\nSupersport Select Sport\r\nSony Max\r\nSound City\r\nStyle Network\r\nSilverbird\r\nAIT\r\nNTA\r\nand so on\r\nGOtv Plus features all GOtv channels with some exclusive channels. Some exclusive channels on GOtv Plus include:\r\n\r\nCNN\r\nDisney Junior\r\nMTV Base\r\nTelemundu\r\nNational Geographic Wild\r\nSony Entertainment TV\r\nSupersport Blitz', '2543', NULL, 'dstv-full-kit-hwwiz', 0.00, NULL, 0, 0, NULL, NULL, '2021-10-24 14:21:55', '2021-11-04 07:24:09'),
