(139, 138, 'Infinix Smart 4 16Gb x653', '1', '<p>Also known as Infinix Smart 4 X653\r\n</p><p>NETWORK	Technology	\r\n</p><p>GSM / HSPA / LTE\r\n</p><p>LAUNCH	Announced	2019, October\r\n</p><p>Status	Available. Released 2019, October\r\n</p><p>BODY	Dimensions	167 x 76 x 8.3 mm (6.57 x 2.99 x 0.33 in)\r\n</p><p>Weight	183 g (6.46 oz)\r\n</p><p>Build	Glass front, plastic back, plastic frame\r\n</p><p>SIM	Dual SIM (Nano-SIM, dual stand-by)\r\n</p><p>DISPLAY	Type	IPS LCD\r\n</p><p>Size	6.6 inches, 105.2 cm2 (~82.9% screen-to-body ratio)\r\n</p><p>Resolution	720 x 1600 pixels, 20:9 ratio (~266 ppi density)\r\n</p><p>PLATFORM	OS	Android 9.0 Pie (Go edition)\r\n</p><p>Chipset	Mediatek MT6761 Helio A22 (12 nm)\r\n</p><p>CPU	Quad-core 2.0 GHz Cortex-A53\r\n</p><p>GPU	PowerVR GE8320\r\n</p><p>MEMORY	Card slot	microSDXC (dedicated slot)\r\n</p><p>Internal	16GB 1GB RAM, 32GB 2GB RAM\r\n</p><p>&nbsp; eMMC 5.1\r\n</p><p>MAIN CAMERA	Single	8 MP\r\n</p><p>Features	Dual-LED flash\r\n</p><p>Video	1080p@30fps\r\n</p><p>SELFIE CAMERA	Single	5 MP\r\n</p><p>Video	1080p@30fps\r\n</p><p>SOUND	Loudspeaker	Yes\r\n</p><p>3.5mm jack	Yes\r\n</p><p>COMMS	WLAN	Wi-Fi 802.11 a/b/g/n, hotspot\r\n</p><p>Bluetooth	5.0, A2DP, LE\r\n</p><p>GPS	Yes, with A-GPS\r\n</p><p>NFC	No\r\n</p><p>Radio	FM radio\r\n</p><p>USB	microUSB 2.0\r\n</p><p>FEATURES	Sensors	Fingerprint (rear-mounted), accelerometer, proximity, compass\r\n</p><p>BATTERY	Type	Li-Po 4000 mAh, non-removable\r\n</p><p>MISC	Colors	Midnight Black, Quetzal Cyan, Cosmic Purple\r\n</p><p>Models	X653</p><p>\r\n</p>', 'en', '2021-07-21 13:23:39', '2021-07-21 13:23:39'),
(140, 142, 'Infinix Hot 8 x650B 2GB RAM 32GB ROM 8MP 4G', '1', '<ul><li>Battery: Non-removable Li-Po 5000 mAh battery\r\n</li><li>Selfie Camera: Single: 8 MP, f/2.0, 25mm (wide)\r\n</li><li>Main Camera: Triple: 13 MP, f/1.8, 26mm (wide), 1/3.1″, 1.12µm, PDAF\r\n</li><li>CPU: Quad-core 2.0 GHz Cortex-A53\r\n</li><li>OS: Android 9.0 (Pie), XOS 5.0\r\n</li><li>SIM: Dual SIM (Nano-SIM, dual stand-by)\r\n</li><li>Size: 6.52 inches, 102.6 cm2 (~81.5% screen-to-body ratio)\r\n</li><li>Internal Memory: 32GB + 2GB RAM</li></ul>', 'en', '2021-07-21 13:31:29', '2021-07-21 13:31:29'),
(141, 141, 'Infinix Hot 8 Lite 6.6\" 2GB RAM 32GB ROM 8MP 3G', '1', '<p>Buy Infinix Smart Phones Online in Uganda from Gadget Boss Uganda and Enjoy Fastest Door to Door Delivery With Flexible Payment On Delivery. Enjoy More shopping from a Wide Range of Original Products like Chargers, Headsets,Cables, Extensions and many more only at Gadget Boss Uganda.\r\n</p><p>The Infinix Hot 8 Lite boasts a Dual 8MP camera and with an 8MP front selfie camera Just like the Infinix Hot 8. There is 6.6-inch IPS display with a 1600 x 720 resolution. 2GB RAM and 32GB internal storage.\r\n</p><p>The Hot 8 Lite is also, a bit, limited in it camera segment; the device is only given a dual rear camera, instead of the triple rear sensors used on the other variants of the Hot 8. The rear sensors are a combination of 8 MP + 0.3 MP for the back, and a single 8-megapixel front-facing sensor, kept in the overhead notch.\r\n</p><p>What’s more? You are also getting a rear placed fingerprint scanner, and of course, a FaceID. But most importantly, is the presence of the same large 5000mAh built-in battery used in the other versions of Hot 8. The Hot 8 Lite runs on Android 9.0 Pie out of the box, based on Infinix XOS 5.0 Cheeta</p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-21 13:40:17', '2021-07-21 13:40:17'),
(142, 139, 'Infinix Smart 5 x657 32Gb 2Gb Ram x657', '1', '<ul><li>NETWORK Technology: GSM / HSPA / 3G\r\n</li><li>SIM: Dual SIM (Nano-SIM, dual stand-by)\r\n</li><li>Size 6.6 inches\r\n</li><li>PLATFORM: OS Android 10 (Go edition)\r\n</li><li>Internal: 32GB 2GB RAM\r\n</li><li>MAIN CAMERA: Triple 8 MP\r\n</li><li>WLAN: Wi-Fi 802.11 a/b/g/n/ac, dual-band, Wi-Fi Direct, hotspot\r\n</li><li>Bluetooth: 4.2, A2DP\r\n</li><li>BATTERY Type: Li-Po 5000 mAh, non-removable</li></ul>', 'en', '2021-07-21 13:48:57', '2021-07-21 13:48:57'),
(143, 145, 'Infinix Hot 10 Play X688B 64GB ROM 4GB RAM 4G', '1', '<p>NETWORK Technology: GSM / HSPA / LTE\r\n</p><p>SIM: Dual SIM (Nano-SIM, dual stand-by)\r\n</p><p>Size: 6.82 inches, 110.5 cm2 (~82.4% screen-to-body ratio)\r\n</p><p>PLATFORM: OS Android 10 (Go edition), XOS 7\r\n</p><p>Internal: 32GB 2GB RAM\r\n</p><p>MAIN CAMERA: Dual 13 MP\r\n</p><p>WLAN: Wi-Fi 802.11 a/b/g/n/ac, dual-band, Wi-Fi Direct, hotspot\r\n</p><p>Bluetooth: 5.0, A2DP, LE\r\n</p><p><br></p>', 'en', '2021-07-21 13:55:36', '2021-07-21 13:55:36'),
(144, 147, 'Infinix 10 T X689C 64 GB ROM 4GB RAM 4G', '1', '<p>ETWORK	Technology	\r\n</p><p>GSM / HSPA / LTE\r\n</p><p>LAUNCH	Announced	2021, May 04\r\n</p><p>Status	Available. Released 2021, May 04\r\n</p><p>BODY	Dimensions	171.5 x 77.5 x 9.2 mm (6.75 x 3.05 x 0.36 in)\r\n</p><p>Weight	-\r\n</p><p>Build	Glass front, plastic back, plastic frame\r\n</p><p>SIM	Dual SIM (Nano-SIM, dual stand-by)\r\n</p><p>DISPLAY	Type	IPS LCD\r\n</p><p>Size	6.82 inches, 110.5 cm2 (~83.1% screen-to-body ratio)\r\n</p><p>Resolution	720 x 1640 pixels (~263 ppi density)\r\n</p><p>PLATFORM	OS	Android 11, XOS 7.6\r\n</p><p>Chipset	Mediatek Helio G70 (12 nm)\r\n</p><p>CPU	Octa-core (2x2.0 GHz Cortex-A75 &amp; 6x1.7 GHz Cortex-A55)\r\n</p><p>GPU	Mali-G52 2EEMC2\r\n</p><p>MEMORY	Card slot	microSDXC (dedicated slot)\r\n</p><p>Internal	128GB 4GB RAM\r\n</p><p>&nbsp; eMMC 5.1\r\n</p><p>MAIN CAMERA	Triple	48 MP, (wide), PDAF\r\n</p><p>2 MP\r\n</p><p>Third, unknown camera\r\n</p><p>Features	Quad-LED flash, HDR, panorama\r\n</p><p>Video	1080p@30fps\r\n</p><p>SELFIE CAMERA	Single	8 MP, (wide)\r\n</p><p>Features	Dual-LED flash\r\n</p><p>Video	1080p@30fps\r\n</p><p>SOUND	Loudspeaker	Yes\r\n</p><p>3.5mm jack	Yes\r\n</p><p>COMMS	WLAN	Wi-Fi 802.11 a/b/g/n/ac, dual-band, Wi-Fi Direct, hotspot\r\n</p><p>Bluetooth	5.0, A2DP, LE\r\n</p><p>GPS	Yes, with A-GPS\r\n</p><p>NFC	No\r\n</p><p>Radio	FM radio\r\n</p><p>USB	microUSB 2.0, USB On-The-Go\r\n</p><p>FEATURES	Sensors	Fingerprint (rear-mounted), accelerometer, proximity, compass\r\n</p><p>BATTERY	Type	Li-Po 5000 mAh, non-removable\r\n</p><p>MISC	Colors	Black, Purple, Morandi Green, Heart of Ocean\r\n</p><p>Models	X689C</p>', 'en', '2021-07-21 13:57:07', '2021-07-21 13:57:07'),
(145, 140, 'Infinix Smart HD 2021 - 6.1\" 2GB RAM 32GB ROM 8MP 5000mAh -', '1', '<p>Massive 5000mAh Battery 4-Day Battery Life, No Charging AnxietyWith a massive 5000mAh battery supporting longer streaming of music and videos, Smart HD is born with a marvelous stamina designed for binge-watching.</p><ul><li>NETWORK Technology: GSM / HSPA / LTE\r\n</li><li>Size: 6.1 inches\r\n</li><li>PLATFORM: OS Android 10 (Go edition), XOS 6.2\r\n</li><li>Internal: 32GB 2GB RAM\r\n</li><li>MAIN CAMERA: Dual 8 MP, f/2.0\r\n</li><li>WLAN: Wi-Fi 802.11 a/b/g/n, hotspot\r\n</li><li>Bluetooth: 5.0, A2DP, LE\r\n</li><li>BATTERY Type: Li-Po 5000 mAh, non-removable</li></ul>', 'en', '2021-07-21 14:04:22', '2021-07-21 14:04:22'),
(146, 149, 'Infinix Hot 9 Play X680 32GB ROM 2GB ROM 4G', '1', '<p>6000mAh Ultra Battery\r\n</p><p>For Unlimited FunHOT 9 PLAY packs with an ultra battery capacity of 6000mAh to power it. Its stylish design with only 8.90mm thickness brings your unique personality to the next level despite the 6000mAh ultra battery capacity. You can now truly enjoy unlimited fun anytime, anywhere!\r\n</p><p>Enjoy the longer using experiences with the help of the smart power-savingsystem - Battery Lab. It is a unique AI power optimization system that improves overall standby time by approximately 15%.Enjoy the mobile cinema experiences with the 6.82\" larger Cinematic display. The 20.5:9 full view ratio is closer to the IMax movie ratio, enable you to an immersive entertainment experience in movie, gaming and streaming.\r\n</p><p>We have improved the battery quality for HOT 9 Play by enhancing 60% battery lifecycle for a longer durability. A longer battery lifecycle means lesser consumption in resources and every improvement is carefully designed and made for Infinix HOT 9 Play users.\r\n</p><p>Intelligently beautify images with AIBeauty Mode function and create your own beauty style while capturing in this mode.\r\n</p><p>Thanks to DTS audio processing technology, you can level up the sound effect to entertain yourself more. Customize your personalized sound effects to enjoy better sound quality experiences in movies, music, and gaming at any time.\r\n</p><p>The new XOS 6 comes embedded askin on the latest android 10 (has been built on top of android 10). Android 10 is an iteration of Android 9. It comes loaded with better features and is faster, convenient and more efficient.\r\n</p><p>Dark theme is a system wide dark mode that is set to be available on all android 10 featured apps. Dark mode is triggered with a dedication dark theme quick settings button that switches between the default light theme and the new dark theme. It can also be triggered via turning on the battery save mode. It will lead to screen power reduction.\r\n</p><p>HOT 9, the new generation of HOT series, has enhanced the processor upgrade from Quad-core to Octa-core, providing you with better performance to handle your movies, apps, browsing, and more with ease.\r\n</p><p>HOT 9 comes in various colors including Quetzal Cyan, Midnight Black, Violet and Ocean wave with a unique Gem Cut Texture, appealing to the youthful spirit and amplifying the series\' positioning.</p>', 'en', '2021-07-21 14:13:56', '2021-07-21 14:13:56'),
(147, 148, 'Infinix 10 T X689C 128 GB ROM 4GB RAM 4G', '1', '<p>The New Hot 10T Series the highly anticipated gaming and entertainment smartphone addition to the  Hot 10 portfolio. The Infinix Hot 10T sets a new standard for power, innovation and style by combining sophisticated processing technologies with long-lasting battery performance, a triple camera with Super Nightscape imaging and an ultra-smooth display, encased in a stunning design inspired by nature.\r\n</p><p>The Hot 10T Series features Infinix’s powerful Dar-link optimization engine software, which improves graphic display and touchscreen sensitivity with self-learning AI algorithm capabilities that minimize lag time. With more than 2.7 billion mobile gamers expected by 2023, the Hot 10T smartphone is equipped with a MediaTek Helio G70 chipset to meet the increasing demand for enhanced gaming experiences.\r\n</p><p>Upgraded Design: The Hot 10T adopts pioneering Laser Micron Lithography Technology to create a beautiful shimmer appearance that draws inspiration from the Salar de Uyuni in Bolivia. With smooth-edges and an under-display selfie camera, the Hot 10T is a highly recommended gaming and entertainment device.\r\n</p><p>Buttery-Smooth Display: Boasting a cutting-edge 6.82” HD+ display with 90Hz refresh rate, consumers gain a brilliant viewing experience when watching the latest CGI visual effects. The 180Hz touch sampling rate delivers optimal responsiveness and the intuitive facial recognition enables faster, safer and more convenient device unlocking.\r\n</p><p>Triple 48MP HD Camera with AI: For the first time within the HOT portfolio, the Hot 10T packs a 48MP HD rear camera, an AI camera and a 2MP depth camera with rear Flash. The all-new Super Nightscape feature enables users to take impressive pictures in dark/low-light scenarios while the 2K resolution video recording captures authentic true-to-life footage.\r\n</p><p>MediaTek Helio G70 Chipset: This chipset packs a powerful performance while maximizing battery life for a superior gaming experience. Leveraging innovative dynamic resource management technology, the connectivity powered by MediaTek’s Helio G70 brings faster response times and quicker frame rates. Furthermore, this results in consistent &amp; reliable connectivity which significantly reduces lag time. \r\n</p><p>A 5000mAh Battery: The impressive battery offers 76 hours of calling time on a single charge. Enhanced by power-saving Power Marathon technology that provides an additional 25% power once the battery runs down to 5%, gamers no longer need to think about dreaded battery shutdowns when playing, or embarrassing low battery notifications on video calls. \r\n</p><p>Advanced Software: The DTS Audio processing technology helps elevate sound effects during gameplay. Users can customize the sound effects for better sound quality experiences in games, music and movies. The Infinix XO7.6 is based on Android 11 with a fresh and smarter interface than its predecessor.\r\n</p><p>Dar-link Ultimate Game Booster: The Hot 10T incorporates Infinix’s optimization engine software, the Dar-link Ultimate Game Booster, which works with the smartphone’s hardware to improve the graphic image stability and screen sensitivity.\r\n</p><p>Secured User Privacy: With user data protection and privacy as a priority, two key systems have been implemented into the Hot 10T. X-Proof secures the screen from behind so that user’s screens won’t be snooped on in public, furthermore, all user data on the device stays on the device and is never uploaded to the cloud. In an era when privacy is more prevalent than ever, Infinix has taken extra steps to fully secure it.\r\n</p><p>The Hot 10T features an AI portrait enhancing 8MP front camera to capture sharp images that reflect the results of a professional camera. This camera is the first-ever in the HOT series to offer eye-tracking autofocus, auto-blur videos and face beautification, empowering users to capture the perfect shot. \r\n</p><p>The Hot 10T also features a nightscape 48MP rear HD camera that allows users to take impressive images and videos in both day and night. The 240FPS slow-motion shooting also helps users capture smooth movements for the perfect action shot. \r\n</p><p>The ultimate smartphone entertainment experience with MediaTek’s Helio G70\r\n</p><p>The Hot 10T is the first in its series to be equipped with MediaTek’s Helio G70 chipset to provide an outstanding performance for avid mobile gamers. The octa-core CPU features two powerful Arm Cortex-A75 CPUs operating up to 2GHz and six Cortex-A55 processors operating up to 1.8GHz, interlinked by a large L3 cache for improved performance.\r\n</p><p>MediaTek’s HyperEngine combines various technologies to enhance the overall gaming experience with sustained performance for a longer period. With this feature, gamers can expect smoother performance in demanding game engines, along with intelligent dynamic management of CPU.\r\n</p><p>The Dual 4G SIM support provides exceptional voice and video call quality via VoLTE/ViLTE services, along with faster connection setup time, more reliable coverage and lower power consumption from either SIM connection.\r\n</p><p>The chipset also features built-in integrated voice wake-up capabilities (VoW) that minimize the power of applications in the Android OS, such as the always-on Google Assistant.\r\n</p><p>Play all day with a long-lasting battery\r\n</p><p>To provide users with a non-stop gaming experience, the Hot 10T comes equipped with a battery capacity of 5000mAh. Based on testing from the Infinix data lab, the Hot 10T supports 55 days on standby, 170 hours of music playback, 15.0 hours of continuous gaming or 76 hours of calls on a full charge.\r\n</p><p>The built-in Safe-Charge technology ensures that the power is automatically turned off once the device is fully charged to avoid overheating and wasting energy, while the Power Marathon technology contributes an extra 25% power when the battery runs low – that’s 3.5 hours of additional call time for users.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-21 14:21:13', '2021-07-21 14:21:13'),
