(156, 182, 'Hisense tv 40 inches  Android (Smart)', '5', '<p>Full HD 1080p resolution and a LED backlight give you a sharp, detailed image. Plus, the Hisense 40\"  Series 6 offers all that performance in a slim design. Now that’s a pretty picture. \r\n</p><p>Touch and go\r\n</p><p>Personalize your entertainment with the Hisense Smart platform. The Hisense 40\" Series 6 provides fast access to Netflix, Amazon Video, YouTube, TikiLive and more through simple “one-touch” hot keys on the remote control. \r\n</p><p>Full speed ahead\r\n</p><p>Don’t struggle to keep your eye on the ball—enjoy fast-paced sports, movies and 4K gaming without the lag. Featuring Motion Rate 120 image processing technology, the Hisense Series 6 keeps the thrills coming by making it easy to follow fast-moving action. \r\n</p><p>Loud and clear\r\n</p><p>What good is a beautiful picture if the sound is tiny and thin? With the Hisense 40\" Series 6, you don’t have to compromise. Prepare to be blown away by the full, detailed, award-winning sound offered by dbx-tv® digital audio technology.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-22 12:04:57', '2021-07-22 12:04:57'),
(157, 184, 'Hisense tv 50 inches 4k', '5', '<p>Hisense 50A7100FS - 50 Inch 4K UHD Smart LED TV - Black\r\n</p><p>The Hisense 50A7100FS 50inch 4K UHD Smart LED TV introduces you to a new age of enchanting 4K resolutions. This resolution is four times as high as a standard Full HD TV! It lends an incredibly realistic picture quality and fantastic blur free motion to enrapture you in your entertainment.\r\n</p><p>The TV maintains a stable performance and high levels of image and audio quality. The audio is brought to you by the powerful Dolby Digital audio technology that makes for mind blowing, theater like immersion. The TV is also endowed with futureproof 4K technologies, such as HDMI and USB ports, and well as a vast array of external ports. \r\n</p><p>The HDMI port offers connectivity to support external devices like gaming consoles and more. This enables faster moving images and colors that look rich and vibrant. If you have a Netflix membership, you can enjoy TV shows and movies on this wide screen as it supports this Internet subscription service. Plus, with support for WiFi, you can connect to all your favorite apps and other smart features.\r\n</p><p>A WIDER VIEWING EXPERIENCE\r\n</p><p>The Hisense 50A7100FS is a 50inch 4K UHD Smart LED TV. It offers a deeper viewing experience by immersing you in vivid, accurate detail. This large screen also provides a wider field of view, along with a wide viewing angle with excellent clarity, contrast, and color saturations.\r\n</p><p>BRING THE WORLD CLOSER\r\n</p><p>Experience the purest colors and crystal clear images on this 50inch LED 4K UHD Smart TV from Hisense. It supports four times the resolutions of conventional Full HD and brings to your living room true to life imagery. With such high resolutions, you get to experience amazing picture quality, colors, and contrast.</p><p>\r\n</p>', 'en', '2021-07-22 12:17:28', '2021-07-22 12:17:28'),
(158, 185, 'Hisense tv 49 inches Android Smart', '5', '<p>Hisense 49\" Android Smart TV, Netflix, YouTube, USB &amp; HDMI Ports + Inbuilt  Free to Air Decorder + Free Wall Mount Bracket - Black\r\n</p><p>Upgrade in your lifestyle by buying yourself a Hisense 49 Inch Smart LED TV. As well as offering Full HD Ready support that lets you to watch HD content in life-like detail, this 49 Inch TV comes with Smart features like a dedicated web browser and popular apps like YouTube and a range of movie on demands services. Playback your stored content directly on the big screen for all to enjoy via a USB device or use it to record TV programmes and even pause live TV.  Order for this Hisense TV online from Jumia Uganda and have it delivered to you.\r\n</p><p>Android TV-a smarter way to watchWith Android TV your favorite content is always front and center to binge-watch or pick up where you left off.  Stream more than 500,000 shows, movies, popular apps like Netflix, Hulu, YouTube and many more. Watch live sports and news from popular channels or gather to watch the hottest videos from YouTube.\r\n</p><p>Clear DisplayThe Hisense 49 inch Full HD LED TV’s makes a perfect addition to contemporary rooms. When switched on, the backlit LED screen churns out images and videos with amazing contrast and details. Witness the entire RCG spectrum brought to life on your screen. The Hisense LED TV brings you exceptionally vibrant and true-to-life images delivered just as the director imagined.\r\n</p><p>Vibrant Sharp ColoursHisense 49 inch Full HD LED TV’s massive 49 inch LED display generates amazingly clear, razor sharp images with a resolution of FULL HD (1920 X 1080). The TV’s 5000:1 dynamic contrast ratio and 50Hz refresh rate ensure that the displayed images are true to life and free of motion blur.\r\n</p><p>USB Ports ConnectivityThe Hisense 49 inch Full HD LED TV is designed to support virtually all the latest peripheral gadgets. The TV features two USB 2.0 ports, to which you can connect your DVD players, cameras, external hard drives, and more. Now you can enjoy all your multimedia content of these gadgets on the big screen, right from the comfort of your couch.\r\n</p><p>Technical Specifications\r\n</p><p>Display\r\n</p><p>Backlight System: LED Backlight\r\n</p><p>Screen size: 49\"\r\n</p><p>Resolution: FULL HD (1920 X 1080)\r\n</p><p>Auto tuning\r\n</p><p>Smart TV\r\n</p><p>Audio\r\n</p><p>MAX Audio Output (RMS): 2 x 6watts\r\n</p><p>Dolby Digital\r\n</p><p>Automatic volume level (AVL)\r\n</p><p>Sound Equalizer\r\n</p><p>Terminal Inputs/Outputs\r\n</p><p>2 x HDMI\r\n</p><p>2 x USB\r\n</p><p>1 x Ethernet\r\n</p><p>Features \r\n</p><p>Digital: DVBT2\r\n</p><p>Internet: WIFI\r\n</p><p>DVB T2\r\n</p><p>ETHERNET\r\n</p><p>Dolby Digital\r\n</p><p>NETFLIX (Pre-installed)\r\n</p><p>Hotel Mode\r\n</p><p>PVR\r\n</p><p>Lip-Sync adjustment\r\n</p><p>Other features\r\n</p><p>Auto switch-off timer\r\n</p><p>Picture Mute\r\n</p><p>Time Shift\r\n</p><p>Sleep timer\r\n</p><p>Key Features\r\n</p><p>Screen Size: 49\"\r\n</p><p>Free TV wall mount bracket\r\n</p><p>Screen Type: LED Backlight TV\r\n</p><p>Screen Resolution: FULL HD (1920 X 1080) \r\n</p><p>Connectivity: Ports: 2 x HDMI, 2 x USB\r\n</p><p>Smart Digital TV\r\n</p><p>What’s in the box\r\n</p><p>HISENSE Smart Digital LED TV\r\n</p><p>User Manual\r\n</p><p>Remote Control\r\n</p><p>Specifications\r\n</p><p>SKU: HI200EL0ZCH08NAFAMZ\r\n</p><p>Display Size (in): 49.0\r\n</p><p>Screen Technology: LED\r\n</p><p>Main Material: ABS plastic\r\n</p><p>Weight (kg): 7.9</p>', 'en', '2021-07-22 12:19:47', '2021-07-22 12:19:47'),
(159, 186, 'Hisense tv 50 inches U7QF (Quatum Dot)', '5', '<p>IntroductionWith this model experience TV like never before in glorious Ultra HD 4K resolution. With 4 times the detail of Full HD see every detail with stunningly realistic picture quality and beautifully natural motion. Backed by the power of a quad core processor, powerful TruSurround Audio, futureproof 4K technologies (including HDMI 2.0, HEVC, USB 3.0) and a wide variety of Smart Apps* you will never want to leave your living room.\r\n</p><p>4K UHDPacking four times the number of pixels into the same screen sizes as traditional 1080p HDTVs, UHD (Ultra High Definition) technology displays four times Full HD resolution enabling stunningly realistic picture quality and beautifully natural motion with incredible detail.\r\n</p><p>Freeview HDWith amazing detail and beautiful, rich colour, HD is the best way to experience programmes on Freeview. Get the UK’s favourite TV channels in high definition subscription free!\r\n</p><p>Smart AppsThis Hisense 4K UHD TV comes with a whole host of the latest Apps for your enjoyment*. Why not try watching video on demand in 4K with either Netflix or YouTube?\r\n</p><p>HDMI 2.0Get the best from your 4K viewing experience. HDMI 2.0 provides the very latest connectivity to support the future of 4K content, allowing faster moving images and much more vibrant colours.HEVC (also known as H.265) is the future standard for 4K video decoding. It allows you to stream 4K content over the web or via USB without requiring any other equipment.￼USB 3.0USB 3.0 provides faster speeds when connecting USB devices that support the technology. This allows playback of large files such as 4K UHD content flawlessly.\r\n</p><p>PVR ReadyA Personal Video Recorder built in to a TV or Monitor allows the user to record TV programmes on to a memory stick through a USB port. There’s no degradation in picture and sound quality when you record a programme, and it’s just as good as watching live TV. So not only can you watch all your favourite TV programmes by recording or even series linking them for the future, you can even pause live TV should you wish.\r\n</p><p>￼Online streamingWith the Hisense 50\" Smart 4K UHD LED TV you\'ll be able to watch all your favourite Netflix, Prime and BBC shows, as well as any YouTube videos. Quickly get to what you want with dedicated buttons to take you straight to your favourite apps.\r\n</p><p>Catch up on your favourite showsMissed the latest episode of your favourite drama? Not to worry, with Freeview Play you\'ll have access to programmes from the last 7 days straight from the TV guide. Not only can you catch up with your shows at a time that suits you, but with the ability to pause and rewind, you can rewatch and relive those shocking scenes over and over again.\r\n</p><p>Get closerYou\'ll be right there in the middle of any scene with your favourite characters thanks to Dolby Audio. It helps you to hear all dialogues clearly so you don\'t have to shush everyone all the time. \r\n</p><p>Experience Amazing 4K Ultra HD HDR Picture Quality With 4K Smart TV.Its 2160p Resolution And 60Hz Effective Refresh Rate Provide Brilliant Picture Quality And Smooth Motion For Optimal Viewing Experience.  Easily Find And Watch More Of Your Favorite Content With Hisense Smart Android TV.with thousands of apps, be sure to get your favorite apps on this awesome android tv.\r\n</p><p>Dolby VisionThese images from the cinema, now brought together for the home, provide amazing realism that you’ll see, and feel like never before.\r\n</p><p>High Dynamic RangeYou’ll be refreshed by what you see— whites look brighter, blacks look darker and colors look more vibrant.\r\n</p><p>Google Voice ControlYou can use your voice to enjoy Google Home features, like media, alarms, lights &amp; thermostats, control the volume, and much more\r\n</p><p>Specifications\r\n</p><p>Screen Size: 50″ Display\r\n</p><p>Free Swivel &amp; tilt Mount for optimum viewing &amp; Easy cleaning\r\n</p><p>Resolution: Ultra HD 4K: 3840×2160\r\n</p><p>HDMI: 3\r\n</p><p>USB: 2\r\n</p><p>AV Input: 1\r\n</p><p>Optical Digital Audio Output: 1\r\n</p><p>Voice Remote\r\n</p><p>Display Type: 4K UHD\r\n</p><p>Smart tv\r\n</p><p>Dolby Vision and HDR\r\n</p><p>Mount size: 14\"-55\" TVs</p>', 'en', '2021-07-22 12:25:09', '2021-07-22 12:25:09'),
(160, 187, 'Hisense tv 55 inches Android 4k Smart', '5', '<p>Hisense 55 Inch 4K Ultra HD Smart TV with Built-in WIFI, In built Free to Air Decoder – Black\r\n</p><p>As the Official Sponsor of the 2018 FIFA World Cup, together we’ll hope hearts in mouths and heads in hands. Our new 2019 range offers a TV experience like never before.\r\n</p><p>Hisense 4K resolution (UHD) TV with 4 times the detail of Full HD see every detail with stunningly realistic picture quality and beautifully natural motion, Hisense 4K HDR Smart TV allows you to play HDR content from compatible source components, such as an Ultra HD 4K Blu-ray player, PS4, XBOX or a USB flash drive.It offers darker blacks, brighter whites and a better contrast, backed by the power of a quad core processor, powerful Tru Surround Audio by DBX, future proof 4K technologies (including HDMI 2.0, HEVC, USB 3.0) and a wide variety of Smart apps you will never want to leave your living room.\r\n</p><p>With an upgraded operating system for 2019 VIDAA U 2.5, with one-touch remote control access, plenty of apps, fast boot and app launch, customizable launcher, brings you to a smarter world. Hisense Smart allows you to connect to a world of on-demand entertainment through built-in apps such as Free view Play with all UK catch up services including BBC iPlayer including Netflix, Amazon Prime, YouTube, and an integrated web browser.\r\n</p><p>No more looking for the remote control, download the “Remote NOW” app from your Android or iOS app store April 2018, and control from your mobile or tablet then customise your own entertainment or cast content and services to your TV!  Also new to the 2019 range, Alexa digital assistant integration; control basic TV functionality and also compatible Echo devices within your home (requires app download) and will become available via OTAfirmware upgrade in Q3.\r\n</p><p>However due to the difference between different monitors, the picture may not reflect the actual color of the item. We guarantee the style is the same as shown in the pictures, Thank you!\r\n</p><p>Make your order here today and have Jumia Uganda deliver it right at your most convenient picking point or doorstep</p>', 'en', '2021-07-22 12:27:03', '2021-07-22 12:27:03'),
(161, 191, 'Changhong 24\" tv', '1', '<p>Changhong Electronics 24 Inch HD Digital LED TV - Black</p><p><b><br></b></p><p><b>LED Technology</b></p><p>LED technology is what is among the best technologies currently on the market. In addition to using the latest technology to screen material,Changhong TV offers a quality/price ratio unbeatable by TVs competing for brands in the same category. Changhong TVs have the best TV aspect ratio, adjustable contrast and brightness features to complement picture quality when watching movies</p><p>Follow Your Matches in the best ways</p><p>With this Changhong Digital  LED TV, you will not only watch the sport at your convenience but also in the best way possible. Improve the image and sound to your advantage, watch every moment with stunning clarity. The sound quality in your living room is identical to the electric atmosphere in the stadium.</p><p><br></p><p><b>FEATURES</b></p><p>Display size: 24 Inches</p><p>Brand :  Changhong</p><p>Color :  Black</p><p>Remote Control :  Yes&nbsp;</p><p>Display Type :  LED</p><p>HDTV :  Yes&nbsp;</p><p>Revolution ：1366x768&nbsp;</p><p>TV Type :  Standard TV&nbsp;</p><p>Audio Support Format :  .mp3</p><p>Video Support Format :  .mpg.avi.ts.mov.mkv.dat.mp4.vob</p><p>Picture Support Format :  .jpg.jpeg.bmp.png</p><p>Text Support Format :  .TXT</p><p>Input Voltage :  100-240V AC 50/60HZ</p><p>Power ON Consumption :  35W</p>', 'en', '2021-07-23 14:18:52', '2021-07-23 14:18:52'),
(162, 192, 'Changchong 32\" DIGITAL TV', '1', '<p><b>KEY FEATURES</b></p><p>Display size : 32 Inches</p><p>Portable : Yes</p><p>Remote Control :Yes</p><p>HDTV : Yes</p><p>TV Type : Standard TV</p><p>Model Number : LED32E6000T</p><p>HD Type : HD</p><p>Display Resolution : 1366x768</p><p>Brand : Changhong</p><p>Color : Black</p><p><br></p>', 'en', '2021-07-23 14:22:36', '2021-07-23 14:22:36'),
(163, 193, 'Changchong 32\" SMART TV', '1', '<p>Changhong 32″ is smart TV with preinstalled android 9 licenced software. It has flat screen with HD pictures. It is having all features of android smartphone even inbuilt memory of 8GB and 1GB ram. From Google play store you can download any application direct in the TV. Netflix, YouTube, Amazon prime already preinstalled. You can run social media apps too. With flash drive and HDMi connection you can connect external storage devices too. It is in fact real smart TV.</p>', 'en', '2021-07-23 14:31:52', '2021-07-23 14:31:52');
