(167, 197, 'Changchong 50\" ANDROID FRAME LESS', '1', '<b>Changhong 50 Inch Android 9 Smart TV- Black\r\n</b><div>The 50\" backlit LED panel of the television produces eye catching HD resolution images that are simply stunning to look at. This TV also has a number of ports to keep you well connected at all times, and these include the USB and HDMI ports.</div><div><br></div><div>\r\n</div><div><b>50\" LED Display\r\n</b></div><div>The Changhong 50 inch HD LED TV’s makes a perfect addition to contemporary rooms. When switched on, the backlit LED screen churns out images and videos with amazing contrast and details.</div><div><br></div><div>\r\n</div><div><b>High Definition TV\r\n</b></div><div>The Changhong 50\" HD LED display generates amazingly clear, razor sharp images with a resolution of HD. More over, it comes with the latest DVB-T2 technology for the best &amp; clearest digital TV signals so you can enjoy in-built free local TV channels off the box.</div><div><br></div><div>\r\n</div><div><b>Digital LED Technology\r\n</b></div><div>Witness the entire RCG spectrum brought to life on your screen. The Changhong LED TV brings you exceptionally vibrant and true-to-life images delivered just as the director imagined.\r\n</div><div><b><br></b></div><div><b>USB Digital Media Player\r\n</b></div><div>Provides you the flexibility to enjoy not only photos or music, but also HD multimedia files directly in your TV via USB.</div><div><br></div><div>\r\n</div><div><b>Explorer More Connectivity Options\r\n</b></div><div>The TV features 1 USB 2.0 ports, and 3 HDMI ports to which you can connect your DVD players, cameras, external hard drives, and more. Now you can enjoy all your multimedia content of these gadgets on the big screen, right from the comfort of your couch. It also features a VGA &amp; PC audio input.</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div><div>\r\n</div>', 'en', '2021-07-23 15:26:02', '2021-07-23 15:26:02'),
