(169, 199, 'Changchong 65\"', '1', '<p><b>KEY FEATURES\r\n</b></p><p>Display size: 65 Inches\r\n</p><p>High sound quality TV\r\n</p><p>Quad-core CPU\r\n</p><p>Full screen display\r\n</p><p>Dual channel: Dolby Vision and HDR10.\r\n</p><p>3 years warranty\r\n</p><p><b>WHAT’S IN THE BOX\r\n</b></p><p>User manual\r\n</p><p>Remote\r\n</p><p>Remote batteries\r\n</p><p>Television\r\n</p><p><br></p>', 'en', '2021-07-23 16:22:39', '2021-07-23 16:22:39'),
(170, 200, 'Changhong Refrigerator CH120', '1', '<p><b>Changhong CH-120 - Single Door Refrigerator - 117 Litres  - Silver\r\n</b></p><p>Feet Energy Star compact fridge is a true space saver for places like a studio apartment, tiny house or home office. Adjustable, removable shelves allow you to customize the interior. The inside of the door is perfect to hold both bottles and cans of your favorite beverage. The freezer compartment also means you’ll have a place for your ready-to-eat frozen meal and a pint of your favorite ice cream for dessert.\r\n</p><p>StorageEnjoy the additional storage provided by the custom design of the inside of the door.\r\n</p><p>FreezerPerfect for when you want a \'ready to eat\' meal on hand or to satisfy a craving.\r\n</p><p>AdjustableOrganize pretty much anyway you want with shelves that are both adjustable and removable.</p><p><b>Specifications\r\n</b></p><p>KEY FEATURES\r\n</p><p>Perfect for when you want a \'ready to eat\' meal on hand or to satisfy a craving.\r\n</p><p>Adjustable:\r\n</p><p>Organize pretty much anyway you want with shelves that are both adjustable and removable.\r\n</p><p><b>Technical Specifications:\r\n</b></p><p>Rated Voltage : 220-240V\r\n</p><p>Rated Frequency : 50Hz\r\n</p><p>Rated Current : 0.45A\r\n</p><p>Gross Capacity : 117L\r\n</p><p>Net Capacity:92L\r\n</p><p><b>WHAT’S IN THE BOX\r\n</b></p><p>Changhong CH-120 - Single Door Refrigerator - 117 Litres  - Silver\r\n</p><p><b>SPECIFICATIONS\r\n</b></p><p>SKU: CH310HL192UXANAFAMZ\r\n</p><p>Warranty Address: 5 Years\r\n</p><p>Color: Silver\r\n</p><p>Model: CH-120\r\n</p><p>Weight (kg): 20</p><p>\r\n</p>', 'en', '2021-07-23 16:29:12', '2021-07-23 19:25:15'),
