(218, 318, 'Hisense Washing Machine 8KG FRONT LOAD', '1', '<p>Hisense 8Kg Automatic Front Loading Washing Machine - Silver\r\n</p><p>Selecting a washing machine that you can trust with clothes is just as important as the detergent you use. All Hisense washing machines are built to the highest standards, making any choice you make a smart choice.\r\n</p><p>OVERVIEW - 360° SMART WASH TECHNOLOGY\r\n</p><p>SMART WATER &amp; POWER USAGE\r\n</p><p>360° Smart Wash Technology automatically measures the weight of your laundry and sets the appropriate washing time.\r\n</p><p>STOP &amp; RELOAD\r\n</p><p>Ever started your front load washing machine and forgot a few items. No need to worry just “Stop and Reload”.\r\n</p><p>SMART SPIN IMBALANCE ADJUSTMENT\r\n</p><p>Redistributes your laundry inside the drum to ensure smooth and quiet spin operation.\r\n</p><p>SMART I. PROGRAM\r\n</p><p>Creature of habit? Save your favorite wash cycle by pressing the “I. Program” button for 3 seconds. Simply recall it on your next wash by pressing a single “I. Program” button.\r\n</p><p>TIME DELAY\r\n</p><p>Want to start your wash cycle later to suit your schedule? Press the “Delay” touch button to select the delay time up to 23 hours.\r\n</p><p>SMART DETERGENT DISSOLVING\r\n</p><p>Automatically measures and adjusts water temperature to better suit dissolve detergent for your wash.\r\n</p><p>SMART FOAM CONTROL\r\n</p><p>Automatically measures and adjusts the amount of foam build-up during the wash cycle. Too much detergent may create excess foam and leave residue on your clothes.\r\n</p><p>SMART WASH TIME ADJUSTMENT\r\n</p><p>Adjusts wash time based on the weight of your laundry.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-24 17:44:09', '2021-07-24 17:44:09'),
