(220, 319, 'Hisense Washing Machine 9KG FRONT LOAD', '1', '<p>Hisense 9Kg Automatic Front Loading Washing Machine - Silver\r\n</p><p>Selecting a washing machine that you can trust with clothes is just as important as the detergent you use. All Hisense washing machines are built to the highest standards, making any choice you make a smart choice.\r\n</p><p>OVERVIEW - 360° SMART WASH TECHNOLOGY\r\n</p><p>SMART WATER &amp; POWER USAGE\r\n</p><p>360° Smart Wash Technology automatically measures the weight of your laundry and sets the appropriate washing time.\r\n</p><p>STOP &amp; RELOAD\r\n</p><p>Ever started your front load washing machine and forgot a few items. No need to worry just “Stop and Reload”.\r\n</p><p>SMART SPIN IMBALANCE ADJUSTMENT\r\n</p><p>Redistributes your laundry inside the drum to ensure smooth and quiet spin operation.\r\n</p><p>SMART I. PROGRAM\r\n</p><p>Creature of habit? Save your favorite wash cycle by pressing the “I. Program” button for 3 seconds. Simply recall it on your next wash by pressing a single “I. Program” button.\r\n</p><p>TIME DELAY\r\n</p><p>Want to start your wash cycle later to suit your schedule? Press the “Delay” touch button to select the delay time up to 23 hours.\r\n</p><p>SMART DETERGENT DISSOLVING\r\n</p><p>Automatically measures and adjusts water temperature to better suit dissolve detergent for your wash.\r\n</p><p>SMART FOAM CONTROL\r\n</p><p>Automatically measures and adjusts the amount of foam build-up during the wash cycle. Too much detergent may create excess foam and leave residue on your clothes.\r\n</p><p>SMART WASH TIME ADJUSTMENT\r\n</p><p>Adjusts wash time based on the weight of your laundry.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-24 17:47:53', '2021-07-24 17:47:53'),
(221, 329, 'Hisense BUILT IN HOB 5 BURNERS GAS (60x70)', '1', '<p><b>The ultimate in gas efficiency.\r\n</b></p><p>Hisense gas hob burners are the ultimate in gas efficiency. Innovatively designed to be easy to control and easy to clean.</p><p><b>Surface Max gives you 20% more space to use.\r\n</b></p><p>Every detail is designed to give you more usable surface, from the hob’s size to the position of controls.</p><p><b>Designed specifically for wok cooking.\r\n</b></p><p>Ideal for quick and powerful cooking, our Wok Burner has a uniquely designed gas crown that heats the larger exterior surface area of a wok perfectly allowing you to cook more food, faster.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-24 17:51:16', '2021-07-24 17:51:16'),
(222, 320, 'Hisense Washing Machine 10KG FRONT LOAD', '1', '<p>Hisense 10Kg Automatic Front Loading Washing Machine - white\r\n</p><p>A quieter, longer lasting and more reliable motor.\r\n</p><p>Inverter Technology allows your washing machine’s motor to rotate at the optimum speed for the load. This results in lower levels of vibration meaning a quieter, longer lasting, and more reliable washing machine that uses less energy than conventional washing machines.\r\n</p><p>Ready to tackle even the most demanding laundry.\r\n</p><p>If you’re looking for a new washing machine, look no further. Our range has one to suit you and whatever life throws at you. From large capacity 10kg drums that are perfect for large families, to budget-friendly options for those households with less demanding laundry needs, there’s a Hisense washing machine for you. \r\n</p><p>A quieter, longer lasting and more reliable motor.\r\n</p><p>Inverter Technology allows your washing machine’s motor to rotate at the optimum speed for the load. This results in lower levels of vibration meaning a quieter, longer lasting, and more reliable washing machine that uses less energy than conventional washing machines.\r\n</p><p>Selecting a washing machine that you can trust with clothes is just as important as the detergent you use. All Hisense washing machines are built to the highest standards, making any choice you make a smart choice.\r\n</p><p>Super-fast spin removes more water to minimise drying time.\r\n</p><p>Sometimes, the simplest ideas make the most difference, like a faster maximum spin that removes more water from your wash to significantly reduce the time it takes to dry.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-24 17:54:12', '2021-07-24 17:54:12'),
