(225, 328, 'Hisense BUILT IN HOB 4 BURNERS GAS (60x60)', '1', '<p>Stainless steel surface\r\n</p><p>Auto-Ignition function\r\n</p><p>Flame Failure Technology\r\n</p><p>Cast Iron Pan Stand</p>', 'en', '2021-07-24 18:08:16', '2021-07-24 18:08:16'),
(226, 327, 'Hisense BUILT IN OVEN BSA5221 BLACK COLOR OVEN', '1', '<p><b>A rounded shape for an Even Bake.\r\n</b></p><p>The Even Bake shape cooks every dish perfectly. Based on traditional wood-burning ovens, this rounded design ensures hot air circulates freely, heating food evenly so that everything you cook is perfectly done – crispy on the outside, juicy on the inside.</p><p><b>Bake the best bread with the Steam Add function.\r\n</b></p><p>With the Steam Add function simply add water to a tray and chose one of three variable settings depending on the level of steam you need. Then set the desired oven temperature. The water evaporation from the steam creates a moist environment, as opposed to just hot air, allowing for the ideal environment for any dough to bake to perfection.</p><p><b>Steam Clean breaks dirt down quickly and easily.\r\n</b></p><p>Loosen grease and stains quickly and easily. Place a water filled baking tray in the oven, select Steam Clean and after only 30 minutes, grease and marks can be wiped off the stain resistant enamel with ease.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-24 18:13:09', '2021-07-24 18:13:09'),
