(249, 342, 'Smart Plus Bass Speaker MP5555', '1', '<p>Stylish yet powerful, these speakers provide the real feel of music with superior sound quality. Easy to Connect &amp; Carry: Wireless Speaker Bluetooth 4.2, 33ft range, Quick pairing any Bluetooth-enabled device, such as Android cellphones, iPhone, iPod and so on. If you don\'t use Bluetooth connection, you can use a 3.5mm AUX cable to plug in the speakers and the other side to insert auxiliary connection device of a smartphone, computer, MP3, MP4, TV and so on.</p>', 'en', '2021-07-25 21:36:42', '2021-07-25 21:36:42'),
(250, 343, 'Sonashi 2 in 1 Blender SB-144', '1', '<p>Juices, protein shakes, smoothies, milkshakes and pancakes can all be on the menu at home with a Sonashi blender. Blending food is a great way to make consuming a variety of fruits and vegetables easily. Take charge of your health by changing the way you eat. Trade-in some of your time-consuming breakfast recipes for fruit smoothies that will give you a burst of energy to start your day. There are numerous easy-to-blend recipes available online. The Sonashi blender is designed to provide performance through power.\r\n</p><p>We all know, how difficult it is to get children to eat their vegetables and fruits. Change tactics to make nutritious food enticing to kids. Blend vegetables into tasty soups, make fruit juices, prepare tomato sauce for pizza, the possibilities are endless. The super-powerful motors used in Sonashi blenders can mince and grind pretty much any ingredient you put in. We have included unbreakable jars, mills and cups for different types of grinding requirements. The stainless steel blades are super durable and very easy to clean.\r\n</p><p>Other features include a safety system for the jars and mills to prevent accidents. The motor overheats protection technology shuts down the Sonashi blender in case the motor gets too hot from prolonged use. Once the motor cools down sufficiently, the blender will resume functioning. This prevents the motor from getting damaged, thereby extending the motor’s life. With large 1.5 L blender jars, you can easily prepare yummy mango milkshakes for the whole family in a jiffy.</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-25 21:41:07', '2021-07-25 21:41:07'),
(251, 344, 'Sonashi 3 in 1 Blender SB-115N', '1', '<ul><li>SUPER POWERFUL MOTOR</li><li>UNBREAKABLE JAR AND MILL</li><li>STAINLESS STEEL BLADE</li><li>1.25L BLENDER JAR CAPACITY</li><li>WITH GRINDING CUP &amp; MINCING CUP</li><li>2 SPEED WITH PULSE SWITCH</li><li>MOTOR OVER HEAT PROTECTION</li><li>SAFETY LOCK SYSTEM</li><li>220-240V ~ 50/60Hz 300-350W</li></ul><p><br></p><p>\r\n</p>', 'en', '2021-07-25 21:44:24', '2021-07-25 21:44:24'),
