(266, 396, 'Stabex 6kg Fullset', '1', '<p>Stabex now offers a fully fledged LPG brand  through its extensive retail and distribution networks across the region. The new LPG product range offers customers quality, safe and reliable gas. Our main goal is to contribute towards the United Nations Sustainable Development Goals (UN-SDG) through distribution of our LPG at affordable prices to the last mile.\r\n</p><p><b>STABEX LPG HEALTH AND SAFETY TIPS\r\n</b></p><p>1). Ensure you buy from authorized dealers/outlets or a Stabex Service Station near you.\r\n</p><p>2). Check the test date to determine if the cylinder is valid.\r\n</p><p>3). Ensure the cylinder has operating guidelines and safety sticker.\r\n</p><p>4). Confirm the weight of the gas before purchase.\r\n</p><p>5). Ensure the gas cylinder is sealed before issuance.\r\n</p><p><b>BENEFITS OF STABEX GAS\r\n</b></p><p>1). Readily available across the region in our service stations, major supermarkets and authorized dealers/outlets.\r\n</p><p>2). Safe, clean and convenient cooking.\r\n</p><p>3). Reasonably priced.\r\n</p><p>4). Spotless kitchen, cooking with Stabex gas does not leave behind thick puffs of smoke, soot or residue.\r\n</p><p>5). Simpler to switch off the burner after use.\r\n</p><p>6). Easy refill.\r\n</p><p>7). Burns consistently making it more reliable.\r\n</p><p>8). Door to door delivery on request and after service.\r\n</p><p>9). Easy to handle with instantaneous on/off knob that offers better control as you cook through flame regulation.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-28 14:18:25', '2021-07-28 14:18:25'),
