(268, 370, 'Sonashi 2 in 1 blender SB-44', '1', '<p>Juices, protein shakes, smoothies, milkshakes and pancakes can all be on the menu at home with a Sonashi blender. Blending food is a great way to make consuming a variety of fruits and vegetables easily. Take charge of your health by changing the way you eat. Trade-in some of your time-consuming breakfast recipes for fruit smoothies that will give you a burst of energy to start your day. There are numerous easy-to-blend recipes available online. The Sonashi blender is designed to provide performance through power.\r\n</p><p>We all know, how difficult it is to get children to eat their vegetables and fruits. Change tactics to make nutritious food enticing to kids. Blend vegetables into tasty soups, make fruit juices, prepare tomato sauce for pizza, the possibilities are endless. The super-powerful motors used in Sonashi blenders can mince and grind pretty much any ingredient you put in. We have included unbreakable jars, mills and cups for different types of grinding requirements. The stainless steel blades are super durable and very easy to clean.\r\n</p><p>Other features include a safety system for the jars and mills to prevent accidents. The motor overheats protection technology shuts down the Sonashi blender in case the motor gets too hot from prolonged use. Once the motor cools down sufficiently, the blender will resume functioning. This prevents the motor from getting damaged, thereby extending the motor’s life. With large 1.5 L blender jars, you can easily prepare yummy mango milkshakes for the whole family in a jiffy.\r\n</p><p><br></p><p><b>Specification</b><br></p><p>Brand	Sonashi\r\n</p><p>Model Number	Sb-144\r\n</p><p>Color	Red\r\n</p><p>Product Dimensions	24.2 x 42.8 x 24.6 cm\r\n</p><p>Material	Glass\r\n</p><p>Item Weight	2.4 kg\r\n</p><p>SUPER POWERFUL MOTOR\r\n</p><p>UNBREAKABLE JAR AND MILL\r\n</p><p>STAINLESS STEEL BLADE\r\n</p><p>1.5L BLENDER JAR CAPACITY / WITH GRINDING CUP\r\n</p><p>2 SPEEDS WITH PULSE SWITCH\r\n</p><p>MOTOR OVER HEAT PROTECTION\r\n</p><p>SAFETY LOCK SYSTEM\r\n</p><p>220-240V ~50/60Hz 300 – 350W</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-28 14:33:31', '2021-07-28 14:33:31'),
(269, 371, 'Sayona SB-4211 Grinder with Mill Blender', '1', '<p><b>Sayona SB-4211 Grinder with Mill Blender - Black\r\n</b></p><p>Buy Sayona Blenders Online in Uganda from Gadget Boss Uganda and Enjoy Fastest Door to Door Delivery With Flexible Payment On Delivery. Enjoy More shopping from a Wide Range of Original SAYONA Products like Blenders, Freezers,Home Theatres, TV\'s and many more only at Gadget Boss Uganda\r\n</p><p>If you are looking for a simple blender that offers more than just blending, then here\'s a deal, the Sayona SB-4211 Blender/Juicer. This appliance comes with a powerful duty 350W motor that has an overheat protection feature that runs the stainless steel cutting blades. It has a blender, Mill and meat Mincer which are all designed to make your work easier.  \r\n</p><p><b>Key Features:\r\n</b></p><p>Very Durable Jug\r\n</p><p>Grinder (for coffee and grain)\r\n</p><p>Stainless steel cutting blades\r\n</p><p>4 speeds\r\n</p><p>350W\r\n</p><p>Note: Due to the difference between different monitors, the picture may not reflect the actual color of the item. We guarantee the style is the same as shown in the pictures. Thank you!\r\n</p><p>Make your order here today and have Gadget Boss Uganda deliver it right at your most convenient picking point or doorstep\r\n</p><p>Please enjoy more shopping of wide range of items at affordable prices on our store at https://shop.kakebe.com</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-28 14:37:48', '2021-07-28 14:37:48'),
(270, 372, 'Sonahsi 4 in 1 SFP-4245 Blender', '1', '<p><b>SAYONA SFP-4245 4 in 1 BLENDER\r\n</b></p><p>JUICE, BLEND, CHOP, GRIND &amp; MINCE\r\n</p><p>?4 in 1 design: Juicer, Blender, Chopper, Grinder/Mincer\r\n</p><p>?Powerful 800W Motor\r\n</p><p>?Easy to Use &amp; Assemble\r\n</p><p>?Stainless Steel Housing\r\n</p><p>?Voltage: 120 V</p><p>\r\n</p>', 'en', '2021-07-28 14:40:20', '2021-07-28 14:40:20'),
(271, 374, 'Sonashi 4 in 1 Juicer Blender SB-35555', '1', '<p>Description;If you are looking for a simple blender that offers more than just blending, then here’s a deal, the Sayona SB-3555 Blender/Juicer. This appliance comes with a powerful heavy duty 400W motor that has an overheat protection feature that runs the stainless steel cutting blades. It has a blender, Mill and meat Mincer.\r\n</p><p>Make your order ,we shall deliver it to you.</p><p>\r\n</p>', 'en', '2021-07-28 14:44:42', '2021-07-28 14:44:42'),
