(276, 376, 'Sayonapps Rice Cooker SRC-4306', '1', '<p>Rice Cooker, Steamer, Stir Fry. Sayona SRC 4306 Deluxe multi cooker is ideal for the busy homemaker. Its 3 functions of rice cooker, steam, and stir fry help with the hard work of cooking healthy meals. Sayona’s multi cooker is a must have in the kitchen. It offers rice cooker, stir fry and steam functions for healthy cooking and has multiple features such as light indicators for rice cooking, stir frying and keep warm settings, making it very easy to use. The removable non stick pot even makes cleaning very easy. The multi cooker is offered in 2.2 Liters capacity.\r\n</p><p>It has a detachable pot and an extra dish for your steaming.</p>', 'en', '2021-07-28 15:44:31', '2021-07-28 15:44:31'),
