(294, 408, 'Sony WH CH510 headphones', '1', '<p>Sony WH-CH510 Wireless Headphones- Black \r\n</p><p>Listen to your music throughout the day without interruptions. The WH-CH510 are wireless, lightweight and have a battery life long enough to keep up with you.\r\n</p><p>Made for life on the move, the WH-CH510 headphones have a lightweight design and are fully wireless. With up to 35 hours of battery life, they’ll have you listening throughout the day.</p><p><br></p><p>The lightweight design and swivel earcups mean you can slip your headphones into a bag when you’re on the move. Plus, the slim, adjustable headband is designed to both look and feel good.\r\n</p><p>Easy operation with buttons   \r\n</p><p>Use the buttons to play, stop, or skip through tracks and adjust the volume.     \r\n</p><p>Voice-assistant compatible   \r\n</p><p>A simple button press connects you to your smartphone\'s voice assistant to get directions, play music, and communicate with contacts. \r\n</p><p>Easy hands-free calling  \r\n</p><p>Conversation flows freely with easy hands-free calling, thanks to the built-in microphone. No need to even take your phone from your pocket.\r\n</p><p>Full Specifications &amp; Features\r\n</p><p>WEIGHT   132g   HEADPHONE TYPE  Closed Dynamic DRIVER UNIT   30mm MAGNET  Ferrite   FREQUENCY RESPONSE(BLUETOOTH® COMMUNICATION)   20Hz - 20,000Hz ( (44.1kHz Sampling) VOLUME CONTROL   Yes WEARING STYLE   Supra Aural   BATTERY CHARGE TIME   Approx. 4.5 hrs (Full charge) BATTERY CHARGE METHOD   USB type-C BATTERY LIFE(CONTINUOUS MUSIC PLAYBACK TIME)   Max. 35h (fully charged)   BATTERY LIFE(CONTINUOUS COMMUNICATION TIME)   Max. 30h (fully charged) BATTERY LIFE(WAITING TIME)   Max. 200h (fully charged)   BLUETOOTH® VERSION Bluetooth Specification version 5.0 EFFECTIVE RANGE  Line of sight approx.10m FREQUENCY RANGE   2.4GHz band (2.4000GHz-2.4835GHz)   PROFILE  A2DP, AVRCP, HFP, HSP SUPPORTED AUDIO FORMAT(S)  SBC, AAC SUPPORTED CONTENT PROTECTION  SCMS-T Sony is committed not only to offering products, services and content that deliver exciting experiences but also to working towards our goal of a zero environmental footprint throughout our business activities.&nbsp;&nbsp;</p><p>\r\n</p><p>\r\n</p><p> \r\n</p><p>\r\n</p><p>                                                                                              \r\n</p><p>\r\n</p><p> \r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-28 18:47:35', '2021-07-28 18:47:35'),
(295, 409, 'Logitech Stero Headset headphone H11', '1', '<p>The simple way to start talking onlineThe simple way to start talking when using computers, smartphones and tablets. Features a standard 3.5mm audio jack and is compatible with most operating systems and platforms. Get just what you need to hear and be heard clearly.\r\n</p><p>MULTI-DEVICE HEADSET\r\n</p><p>The perfect business headset for voice calls, Skype, webinars and more. The 7.71 ft (235cm) cable is just the right length to give you the freedom to stand up and stretch during long conversations.\r\n</p><p>Stereo sound\r\n</p><p>Enjoy clear audio for music, games and calls. A reliable headset for daily tasks including video calls with family or colleagues.\r\n</p><p>Rotating microphone\r\n</p><p>Boom can rotate 180°to be worn on the left or right. Flexible mic can be positioned for better voice capture and background noise reduction. Boom can be tucked out of the way when you’re not using it.\r\n</p><p>Adjustable headband\r\n</p><p>Sturdy yet lightweight stereo headset has a broad range of adjustment. Ultra-soft foam ear cushions provide hours of comfort.\r\n</p><p>3.5mm audio jack connection\r\n</p><p>Simply plug the 3.5mm jack into your computer, smartphone or tablet and you’re ready to talk.\r\n</p><p><br></p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-07-28 18:55:30', '2021-07-28 18:55:30'),
