(300, 415, 'NOKIA 110 - BLACK - GARANSI RESMI NOKIA Phone', '1', '<p>Soundtrack every moment Keep thousands of songs in your pocket with the built-in MP3 player and a MicroSD card slot for up to 32GB of expandable storage1. Plus, the long-lasting battery means you can listen from sun up to sun down.FM RADIOIn tune with youPlug in your headset, switch over to FM radio2 and stay up to date with the latest news and tunes from the stations you love.Beat your high scoreSteal a fun moment for yourself with Snake. And if you can tear yourself away from the gaming classic, there are four equally addictive try-and-buy games to choose from, including Doodle Jump and Football Cup.Capture the world around youSee something you love? Record it. Turn moments into lasting memories with a photo or video captured from the rear camera.Solid phone. Solid style.Designed to withstand everyday wear and tear, Nokia 110 is made of tough polycarbonate contoured to fit perfectly in the palm of your hand. With three colors to choose from – you can make sure it suits your style too.Winner: iF DESIGN AWARD 2020Awarded by Hannover-based iF International Forum Design GmbH, Nokia 110 was recently selected as a winner of the iF DESIGN AWARD, the world-renowned design prize.</p>', 'en', '2021-07-29 20:36:23', '2021-07-29 20:38:53'),
