(362, 519, 'Hisense Fridge Double Door RT715', '1', '<p>014 - The Hisense French door Fridge Freezer comes in a sleek stainless steel colour with a net capacity of 700L to give you massive storage space. The model has an efficient A+ energy rating. This frost free fridge freezer with multi air flow system has a variety of functions such as super cool, super freeze and holiday mode to save energy and better preserve the food to stay fresh for longer. This french door fridge freezer also has a non-plumbed water dispenser for chilled water.\r\n</p><p>Total no frost technology: the system maintains a constant flow of cold air through the appliance which prevents the build-up of ice and frost on the inside of the freezer. It will keep your refrigerator at a suitable condition, helping keep the food\'s freshness and nutrition for longer.\r\n</p><p>The electronic LED display panel with touch control system on the door provides enhanced convenience for you to select the correct temperature for fridge and freezer, and also to choose variety of functions such as super cool and super freeze.\r\n</p><p>Two moisture fresh crispers are fruit and vegetables boxes with a humidity adjustment system, which allows you to set the temperature to meet different foods storage requirements, keeping your food fresh for longer.\r\n</p><p>Overview:\r\n</p><p>Frost free.\r\n</p><p>Fridge capacity 700 litres.\r\n</p><p>Manufacturer\'s 2 year guarantee.\r\n</p><p>Controls:\r\n</p><p>Electronic temperature control.\r\n</p><p>Temperature display.\r\n</p><p>Performance:\r\n</p><p>Energy efficiency rating: A+.\r\n</p><p>Energy consumption: 410kWh per year based on standard test results for 24 hours.\r\n</p><p>Operating temperature 10c to 43c°C.\r\n</p><p>Noise level 43dB.\r\n</p><p>Star rating: 4.\r\n</p><p>Fridge specifications:\r\n</p><p>3 shelves (anti-spill safety glass).\r\n</p><p>Automatic defrost.\r\n</p><p>2 salad crisper compartments.\r\n</p><p>2 vegetable compartments.\r\n</p><p>Quick chill compartment.\r\n</p><p>Non plumbed water dispenser.\r\n</p><p>My fresh choice room design.\r\n</p><p>Freezer specifications:\r\n</p><p>Fast freeze function.\r\n</p><p>3 storage compartments.\r\n</p><p>Easy slide big draw function.\r\n</p><p>20 hours power failure safe storage.\r\n</p><p>General information:\r\n</p><p>Rear panel material: metal.\r\n</p><p>Freezer at bottom.\r\n</p><p>Open door alert.\r\n</p><p>EAN: 6943619729600.</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p><p>\r\n</p>', 'en', '2021-08-06 16:17:04', '2021-08-06 16:17:04'),
