(709, 988, 'Hisense 50 Inch 4K Ultra HD Smart TV with built-in WIFI', '5', '<p>Hisense 50 Inch 4K Ultra HD Smart TV with built-in WIFI - Black</p><p>The 50\" backlit LED panel of the television produces eye catching HD resolution images that are simply stunning to look at. This TV also has a number of ports to keep you well connected at all times, and these include the USB and HDMI ports.</p><p>image</p><p><br></p><p><br></p><p>50\" LED DisplayThe Hisense 50 inch HD LED TV’s makes a perfect addition to contemporary rooms. When switched on, the backlit LED screen churns out images and videos with amazing contrast and details.No</p><p>High Definition TVThe Hisense 50\" HD LED display generates amazingly clear, razor sharp images with a resolution of 4k Ultra HD. More over, it comes with the latest DVB-T2 technology for the best &amp; clearest digital TV signals so you can enjoy in-built free local TV channels off the box.</p><p>Digital LED TechnologyWitness the entire RCG spectrum brought to life on your screen. The Hisense LED TV brings you exceptionally vibrant and true-to-life images delivered just as the director imagined.</p><p><br></p><p>USB Digital Media PlayerProvides you the flexibility to enjoy not only photos or music, but also HD multimedia files directly in your TV via USB.<br></p><p>Explorer More Connectivity OptionsThe TV features 1 USB 2.0 ports, and 3 HDMI ports to which you can connect your DVD players, cameras, external hard drives, and more. Now you can enjoy all your multimedia content of these gadgets on the big screen, right from the comfort of your couch. It also features a VGA &amp; PC audio input.</p><p><br></p><p><br></p><p>Technical Specifications</p><p>Display</p><p>Technology: LED</p><p>Screen Size: 50 Inches&nbsp;</p><p>Resolution: 4k</p><p>Display Ratio: 16:9; UHD Ready</p><p><br></p><p>Audio</p><p>MAX Audio Output (RMS): 6W + 6W</p><p>Dolby Digital</p><p>Sound Equalizer</p><p>Audio File Format: MP3, AAc, M4A, WAV&nbsp;</p><p><br></p><p>Video:</p><p>AV Colour Format: PAL, NTSC, SECAM</p><p>Component Mode: 480i/60Hz, 480p/60Hz, 576i/50Hz, 576p/50Hz, 720p/50Hz, 720p/60Hz, 1080i/50Hz, 1080i/60Hz, 1080p/50Hz, 1080p/60Hz</p><p>VGA Mode: 640 x 480, 800 x 600, 1024 x 768, 1280 x 1024 - 60Hz</p><p><br></p><p>HDMI</p><p>Mode: 480i/60Hz, 480p/60Hz, 576i/50Hz, 576p/50Hz, 720p/50Hz, 720p/60Hz,</p><p>1080i/50Hz, 1080i/60Hz, 1080p/50Hz, 1080p/60Hz. 640 x 480, 800 x 600,</p><p>1024 x 768 - 60Hz</p><p>USB Video Format: AVI, MKV, FLV, TS, MP4</p><p>Photo Format: JPEG</p><p><br></p><p>Connectivity:</p><p>HDMI: 3</p><p>USB: 1</p><p>VGA: 1</p><p>Optical Output: 1&nbsp;</p><p>Audio Jack: 1</p><p>AV Input: 1</p><p><br></p><p>Features:</p><p>Narrow Frame</p><p>Digital Media player</p><p>Digital High Definition Tuner</p><p>Television System:</p><p>PAL/SECAM-B/G,D/K DVB-T+C DVB-T2 DVB-S/S2</p><p>PVR, DV3 Digital Receiver</p><p><br></p><p>Power</p><p>Energy Efficiency class A +&nbsp;</p><p>Power Supply: AC 220-240V 50/60Hz&nbsp;</p><p>Power Consumption On-Mode: 30W</p><p>Annual Energy Consumption: 44 kWh per year on 4 hours operation for 365 days.</p><p>\r\n</p>', NULL, '2021-10-10 15:55:34', '2021-10-10 16:15:56'),
