(716, 991, 'Air Mouse C120 Wireless Smart TV Keyboard', '1', '<p>C120 2.4 Remote Control Air Mouse Wireless Keyboard for KODI Android Mini TV Box</p><p><br></p><p>Description:</p><p><br></p><p>Size: Approx. 15.1*4.5*1.4cm / 5.94*1.77*0.55inch (L*W*H)</p><p>Sensor: 3 axes Gyro-sensor + 3 axes G-sensor</p><p>Compatible: For Windows, Mac OS, Linux, Android</p><p>Operating distance: 10m</p><p>Battery Type: Rechargeable lithium battery 300mAh (included)</p><p>Charging voltage: DC 5V</p><p>Charging current: Max. 330mA</p><p>Working current: 20mA</p><p>Standby current: 20μA</p><p><br></p><p><br></p><p><br></p><p>Features:</p><p>Mini fly air mouse, wireless keyboard and remote controller, multi-functional and practical.</p><p>6 axial Gyro-sensor can achieve 360°free space action recognition and sensing, ultra sensitive and accurate operation.</p><p>USB receiver, 2.4G wireless transmission, long operating distance up to 10 meters.</p><p>Voice input function: support voice chat and voice search, very convenient for kids to operate.</p><p>Fly air mouse, intelligent anti-shake algorithm, precise positioning, powerful tool for playing games.</p><p>Auto sleep and wake-up feature: it will enter sleep mode without operation around 15s.</p><p>Simple installation, plug and play, convenient for conference, presentation and lecturing.</p><p>LED indicator for connection status.</p><p>Built-in rechargeable lithium battery, easy to charge through USB cable.</p><p>Applicable to smart TV, set-top box, Android TV box, network player, PC etc.</p><p><br></p><p>Package Included:</p><p>1 * 2.4GHz Air Mouse Keyboard Remote Control</p><p>1 * USB Receiver</p><p>1 * USB Charging Cable</p><p>1 * User Manual (English)</p>', NULL, '2021-10-14 10:27:38', '2021-10-14 10:27:38'),
(717, 992, 'Hisense 9000Btu Wall Split Air Conditioner – A/C', '1', '<p>Hisense EASY SMART 2.5KW 9000BTU R32 A++/A+ Air Conditioner</p><p><br></p><p>Air conditioners Easy Smart Hisense Easy Smart air conditioners are a concentration of technology that helps to create the ideal climate in the environment in which they are installed. Energy saving is guaranteed by the 3D inverter supplied and the revolutionary 3-section heat exchanger that reduces annual energy consumption by 30% compared to a traditional air conditioner.</p><p><br></p><p>The 4 filters in 1 that are removable and washable guarantee excellent air quality, the filters are as follows:Vitamin C filter releases vitamin C into the air. Vitamin C penetrates your skin providing protection from ultraviolet rays, retaining active oxygen and promoting collagen production.The catechin filter removes odours and eliminates dirt and particles in the air and in the room.HEPA filter effectively removes pollen, grinding dust, pneumobacillus, ensuring you fresh and healthy airAroma Filter this filter on the air conditioner will give a heavenly scent to your room, when you add your favorite perfume to the aroma filter.</p><p><br></p><p>Below are the main features:New environmentally friendly R-32 gasLED display19 db(A)Low temperature heating4 SLEEP functions: Sleep is vital for our body and comfortable rest is good for our health. Hisense air conditioners adapt to everyone\'s sleep.Auto vertical airflow adjustmentSuper Cooling: By selecting the Super function from the remote control, the air conditioner quickly reduces the temperature in the room, increasing the cooling capacity by 25%.SMART function: If you press the Smart button on the remote control, the air conditioner will work in the most comfortable mode according to the room temperatureSpecial 8°C restart: The special 8°C warm-up mode is very useful especially for homes located in areas with colder temperatures (and in second homes). During your absence, in fact, the unit will start in heating mode as soon as it detects a temperature below 8°C allowing your rooms not to freeze and reducing the level of humidity in the air.Auto RestartDimmeri-FEEL function: The sensor inside the remote control is able to detect the surrounding temperature and transmit this information to the indoor unit. The indoor unit operates according to the detected temperature. The intelligent temperature control ensures a more comfortable environment and a more precise temperature control, saving energy.Timer 24h: In Hisense air conditioners this function allows you to select the time to turn on and off the air conditioner over a period of 24 hours.Remote control with backlit displayRemovable and washable panelActivated carbon filterEvaporator anti-bacteria</p><p><br></p><p>Technical features</p><p><br></p><p>CoolingMin/Max capacity: 2.6 KW 1.0/3.00Nominal input power: kW 0.85 (0.19-1.5)SEER 6,1Energy Class: A++EER 3,04Indicative annual energy consumption kW/a 149HeatingMin/Max Capacity: 2.7 KW 1.0/3.0Nominal input power: 0.7 (0.19-1.5)SCOP: 4.0Seasonal energy efficiency class A+COP 3.86Indicative annual energy consumption: kWh/a 700Indoor Unit FeaturesDimensions: (WxHxD) 790x255x200 mmWeight 7,1KgProcessed air Max cubic meters/min 9.2Dehumidification capacity l/hr 0.9Sound pressure level Min-Max dBa 19-38Sound Power Level dBA (C-H) 56External Unit FeaturesDimensions: (WxHxD) 660x483x240 mmWeight 23KgSound Pressure Level (C-H) dBa 47-54Sound Power Level dBA 62Power supply Single-phase 220-240 / 50HzLiquid/Gas piping 6.35 (1/4\") - 9.52 (3/8\")Max/min piping length 15 metersMax height difference between indoor/outdoor unit 8 metersRefrigerant Type: Gas R32Length of pipes without added charge 5 metres Precharge Kg TCO2Eq 0.31Additional refrigerant charge g/m 20Operating range in cooling mode -15 - 43Operating range in heating mode -15 - 24</p>', NULL, '2021-10-14 14:46:30', '2021-10-14 14:47:47'),
