(727, 183, 'Hisense tv 43 inches Digital', '5', '<p>Hisense 43\" Frameless Digital TV - Black\r\n</p><p>The 43\" backlit LED panel of the television produces eye catching HD resolution images that are simply stunning to look at. This TV also has a number of ports to keep you well connected at all times, and theseinclude the USB and HDMI ports. \r\n</p><p>43\" LED DisplayThe Hisense 43 inch HD LED TV’s makes a perfect addition to contemporary rooms. When switched on, the backlit LED screen churns out images and videos with amazing contrast and details.\r\n</p><p>High Definition TVThe Hisense 43\" HD LED display generates amazingly clear, razor sharp images with a resolution of full HD. More over, it comes with the latest DVB-T2 technology for the best &amp; clearest digital TV signals so you can enjoy in-built free local TV channels off the box.\r\n</p><p>Digital LED TechnologyWitness the entire RCG spectrum brought to life on your screen. The Hisense LED TV brings you exceptionally vibrant and true-to-life images delivered just as the director imagined.\r\n</p><p>USB Digital Media PlayerProvides you the flexibility to enjoy not only photos or music, but also HD multimedia files directly in your TV via USB. Explorer More Connectivity OptionsThe TV features 1 USB 2.0 ports, and 3 HDMI ports to which you can connect your DVD players, cameras, external hard drives, and more. Now you can enjoy all your multimedia content of these gadgets on the big screen, right from the comfort of your couch. It also features audio input.\r\n</p><p>Technical Specifications\r\n</p><p>Display•Technology: LED•Screen Size: 43 Inches •Resolution: Full HD•Display Ratio: 16:9; UHD Ready\r\n</p><p>Audio•MAX Audio Output (RMS): 6W + 6W•Dolby Digital•Sound Equalizer•Audio File Format: MP3, AAc, M4A, WAV \r\n</p><p>Video:AV Colour Format: PAL, NTSC, SECAMComponent Mode: 480i/60Hz, 480p/60Hz, 576i/50Hz, 576p/50Hz, 720p/50Hz, 720p/60Hz, 1080i/50Hz, 1080i/60Hz, 1080p/50Hz, 1080p/60HzVGA Mode: 640 x 4