(728, 999, 'Hisense tv 43 inch Smart TV', '5', '<p>Be prepared to imagine a new era of television with the Hisense Smart TV. Be connected to thousands of movies, music and games on the brilliant TV display. Let yourself go wherever your imagination can take you with the Hisense Smart TV experience.</p><p><br></p><p>43\" LED DisplayThe Hisense 43 inch FHD LED TV’s makes a perfect addition to contemporary rooms. When switched on, the backlit LED screen churns out images and videos with amazing contrast and details.</p><p><br></p><p>USB Ports ConnectivityThe Hisense 43-inch FHD LED TV is designed to support virtually all the latest peripheral gadgets. The TV features two USB 2.0 ports, to which you can connect your DVD players, cameras, external hard drives, and more. Now you can enjoy all your multimedia content of these gadgets on the big screen, right from the comfort of your couch.</p><p><br></p><p>Technical Specifications</p><p>Display•Backlight System: Direct LED•Brightness (cd/m.sq): 300•Native Contrast Ratio: 4000:1•Panel Resolution: 1080ppi•Response Time(ms): 8ms(Grey to Grey)•Viewing Angle: 164°/124°</p><p>Smart TV•Wireless Inside: Yes•Facebook App: Yes•Twitter App: Yes</p><p>Digital Multimedia Player•Play back multiple audio &amp; video files   from external USB storage: Yes•Music Playback:     Yes•Display Photos:     Yes•Video Playback: Yes</p><p>Reception System•Auto Tune Setup Wizard: Yes•AV Colour Sytem: PAL</p><p>Audio•MAX Audio Output (RMS): 2 x 10watts•Dolby Digital: Yes•Automatic volume level (AVL): Yes•Sound Equalizer: Yes•Audio Enhancement: dbx-TV</p><p>Terminal Inputs/Outputs•MHL (shared with HDMI)•HDMI•HDMI CEC•Ethernet / LAN Input•Optical/ Digital Audio Output (SPDIF) USB Ports•AV Input (Audio &amp; Video)•Component Input (YPbPr)•Headphone (3.5 mm)•RF Tuner</p><p>Key Features•Screen Size: 43\" •Brand: Hisense •Colour: Black•Durable TV•Condition: 100% new•Resolution: 1080ppi•Inbuilt free to Air Digital Decoder •Smart TV with Built-in WIFI•HDMI Allows Multiple HD Connections•D-LED Technology.•High Contrast Ratio for “Blacker” Blacks &amp; Brighter Colors</p><p><br></p><p>What’s in the boxHisense 43\" Smart TVRemote Contol User manual</p><p>\r\n</p><p>\r\n</p>', NULL, '2021-10-24 13:15:49', '2021-10-24 13:15:49'),
