(730, 1001, 'STAR TIMES Decoder, Antenna + 1 Month Subscription Package', '1', '<p>StarTimes is the leading digital TV operator in Africa, serving nearly 20 million users with a signal covering the whole continent and a massive distribution network of 200 brand halls, 3,000 convenience stores and 5,000 distributors. StarTimes owns a featured content platform, with 480 authorized channels consisting of news, movies, series, sports, entertainment, children\'s programs, etc. The company\'s vision is \"To ensure that every African family can access, afford, watch and share the beauty of digital TV\". StarTimes achieves this by combining setellite and terrestrial DTV systems as well as OTT services to provide an open and secure digital wireless platform. The company provides a robust signal transmission service for public and private broadcasters, offers consumers outstanding Pay-TV programs, mobile multimedia, wireless Internet connectivity and convenient online services.</p><p><br></p><p>Africa’s leading pay-TV operator StarTimes has acquired exclusive broadcasting rights for UEFA Europa League in Sub-Saharan Africa until 2021.This season will be intense for football fans with Bundesliga, French Ligue 1, FIFA Club World Cup, French &amp; Italian Cups and now UEFA Europa League.”</p>', NULL, '2021-10-24 14:05:44', '2021-10-24 14:05:44'),
(731, 1002, 'Gotv Decoder + Antenna', '1', '<p>Gotv is a pay TV service offered in Africa by Multichoice Africa. Unlike the other pay TV service from Multichoice Africa (DSTV), which is setellite based, Gotv is terrestrial digital TV service. So, no need for dish and ceremonial installation, leading to reduced access cost. Gotv is currently available in select cities in Nigeria, Zambia, Uganda, Ghana, Malawi, Namibia, Zimbabwe, and Kenya.</p><p><br></p><p>Digital TV with no dish required. it s network is nation wide</p><p><br></p><p>GOtv utilises the latest Digital Terrestrial Broadcast Technology, The broadcast method is similar to that used by the likes of NTA and AIT, but is digital with better quality audio and video. Perhaps the closest service to Gotv is Startimes, a digital pay TV service based on</p><p><br></p><p>Gotv Coverage</p><p><br></p><p>Gotv is a digital terrestrial TV service, not setellite TV. So, the service is deployed through TV masts and accessible only in locations with GOtv transmitter coverage. Currently GOtv is available in the following cities in Nigeria and in some cases their environs: Lagos, Enugu, Ibadan, Abeokuta, Benin City Owerri, Akwa Ibom, and Port Harcourt.</p><p><br></p><p>The major advantage of the GOtv setup is that no setellite dish is required leading to low/zero installation cost. It is plug n play, so you can install it yourself. Any TV antenna can be used for receiving the GOtv signals.</p><p><br></p><p>Gotv Prices</p><p><br></p><p>The decoder comes with an outdoor antenna (a.k.a GOtenna), which offers better reception with better quality video and audio.</p><p><br></p><p>Initial Gotv access cost  varies Naira for decoder, outdoor antenna, remote, and 1 month free Gotv plus package.</p><p><br></p><p>No dish, means that GOtv is not affected by weather easily as the case with pay TV setellite services like DSTV.</p><p><br></p><p>GOtv Channels &amp; Packages</p><p><br></p><p>GOtv offers two pay bouquets, namely the GOtv standard package, which offers 25 channels and goes for N1,250 per month and GOtv Plus package, which has 38 channels is priced at N1,800 monthly.</p><p><br></p><p>There is also the GOtv Open which currently offers up to 7 free to air channels free once you pay a one-off non-refundable 6,600 Naira administrative fee.</p><p><br></p><p>Some channels available on the GOtv package include:</p><p><br></p><p>Africa Magic (World, Movies, Yoruba, Hausa)</p><p>Al Jazeera</p><p>BET</p><p>Discovery World</p><p>E! Entertainment</p><p>KidsCo</p><p>Channel O</p><p>Supersport Select Sport</p><p>Sony Max</p><p>Sound City</p><p>Style Network</p><p>Silverbird</p><p>AIT</p><p>NTA</p><p>and so on</p><p>GOtv Plus features all GOtv channels with some exclusive channels. Some exclusive channels on GOtv Plus include:</p><p><br></p><p>CNN</p><p>Disney Junior</p><p>MTV Base</p><p>Telemundu</p><p>National Geographic Wild</p><p>Sony Entertainment TV</p><p>Supersport Blitz</p>', NULL, '2021-10-24 14:23:04', '2021-10-24 14:23:04'),
(732, 1003, 'Saachi 17\" tv', '1', '<p>Changhong Electronics 17 Inch HD Digital LED TV - Black</p><p><b><br></b></p><p><b>LED Technology</b></p><p>LED technology is what is among the best technologies currently on the market. In addition to using the latest technology to screen material,Changhong TV offers a quality/price ratio unbeatable by TVs competing for brands in the same category. Changhong TVs have the best TV aspect ratio, adjustable contrast and brightness features to complement picture quality when watching movies</p><p>Follow Your Matches in the best ways</p><p>With this Changhong Digital  LED TV, you will not only watch the sport at your convenience but also in the best way possible. Improve the image and sound to your advantage, watch every moment with stunning clarity. The sound quality in your living room is identical to the electric atmosphere in the stadium.</p><p><br></p><p><b>FEATURES</b></p><p>Display size: 17 Inches</p><p>Brand :  Changhong</p><p>Color :  Black</p><p>Remote Control :  Yes&nbsp;</p><p>Display Type :  LED</p><p>HDTV :  Yes&nbsp;</p><p>Revolution ：1366x768&nbsp;</p><p>TV Type :  Standard TV&nbsp;</p><p>Audio Support Format :  .mp3</p><p>Video Support Format :  .mpg.avi.ts.mov.mkv.dat.mp4.vob</p><p>Picture Support Format :  .jpg.jpeg.bmp.png</p><p>Text Support Format :  .TXT</p><p>Input Voltage :  100-240V AC 50/60HZ</p><p>Power ON Consumption :  35W</p>', NULL, '2021-10-27 12:34:22', '2021-10-27 12:34:22'),
