(737, 96, 'Dabur Herbel natural toothpaste 150g', 'pc', '<p>FLUORIDE FREE: Black Seed herbal toothpaste is a complete herbal oral and dental care necessity for your morning routine, Crafted with rich natural vegan ingredients for a natural alternative to commercial toothpastes\r\n</p><p>Multiple Benefits under herbal protection with key ingredients like Nigella Sativa ginger lemon sea salt grapefruit rose hip resin licorice olive oil and more all pack edged in a fine natural toothpaste tooth paste. It can  be used by both kids and adults where it also promotes health gums, fresh breath, whitening and also takes care for the sensitivity in the teeth.its a naturally herbal toothpaste that is made out of black seed or mostly known as black cummin plant  that is widely known world wide.\r\n</p><p>Many of us already look to fill our homes with organic foods and natural skincare products, and why not do the same for our teeth? Making the switch to organic and natural toothpastes means fewer chemicals and additives, and more natural whiteners and essential oils for minty fresh breath. We’ve highlighted 11 organic, natural, and fluoride-free toothpastes that are keeping you and your family cavity-free and clean all day. Whether you have a picky baby or sensitive gums, these toothpastes and toothpowders are sure to be gentle, refreshing, and loved by all.\r\n</p><p>Dabur Herb\'l toothpaste is enriched with natural ingredients like Blackseed oil and teatree oil that has natural anti bacterial properties.</p>', NULL, '2021-11-01 18:04:43', '2021-11-01 18:04:43'),
